('node', 'article', 0, 3, 3, 'und', 0, '\r\n<div style="text-align: center;"><div style="text-align: left;">Tối đêm ngày 9/1, nhiệt độ ngoài trời đã hạ xuống thấp nhất từ đầu mùa Đông tới nay, vì vậy, tại khu vực Trạm Tôn hay Ô Quý Hồ ở Sa Pa, tuyết đã rơi trắng xóa cả vùng rộng lớn. Chỉ sau 1 đêm, nhiều nhà cửa, cây cối đã chìm trong lớp tuyết trắng.&nbsp;</div><div style="text-align: left;"><span style="font-style: italic; "></span></div><div><img src="http://k14.vcmedia.vn/k:thumb_w/600/yAShWn1vYX1ZtVKYIOhlKC41QCTBRW/Image/2015/01/IMG_2015011031528-1-copy-a36d8/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="1000" h="667" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 1" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 1" lb="1"><span style="font-style: italic; ">Những hình ảnh tuyết rơi trắng xóa tại khu vực gần Thác Bạc.&nbsp;</span></div><div></div><div><span style="font-style: italic; "><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011036154-1702e/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 2" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 2" lb="2">Những bông tuyết đậu trắng phủ kín hàng rào, ánh lên trong đêm.&nbsp;</span></div><div><span style="font-style: italic; "><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011038498-1702e/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 3" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 3" lb="3"></span><span style="font-style: italic; ">Và cây cối.&nbsp;</span></div><div><span style="font-style: italic; "></span></div><div><span style="font-style: italic; "><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011040723-1702e/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 4" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 4" lb="4">2 bên đường đầy tuyết trắng.&nbsp;</span></div><div><span style="font-style: italic; "><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011045354-1702e/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 5" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 5" lb="5"></span></div><div><span style="font-style: italic; "><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011047799-1702e/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 6" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 6" lb="6">Nhiệt độ ngoài trời tại khu vực gần Thác Bạc đã hạ xuống dưới 0 độ C vào đêm ngày 9/1.&nbsp;</span></div><div><span style="font-style: italic; "></span></div><div style="text-align: left;">Biết tin khu vực Sa Pa có thể sẽ có tuyết rơi vào đêm 9/1, sáng 10/1, rất đông du khách đã nhanh chóng lên đường tới thăm Sa Pa để được ngắm tuyết rơi - hiện tượng thiên nhiên hiếm gặp tại Việt Nam.&nbsp;</div></div><div style="text-align: center;"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011034742-23205/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 7" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 7" lb="7"></div><div style="text-align: center;"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011045156-23205/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 8" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 8" lb="8"><span style="font-style: italic; ">Tuyết trắng phủ kín bên tuyến đường dẫn lên Sa Pa.</span></div><div style="text-align: center;"><span style="font-style: italic; "></span></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011028831-9a4fc/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 9" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 9" lb="9"></div><div style="text-align: center;"><span style="font-style: italic; ">Những căn nhà phủ đầy tuyết trắng.</span></div><div style="text-align: center;"><span style="font-style: italic; "></span></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011047630-23205/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 10" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 10" lb="10"></div><div style="text-align: center;"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/yAShWn1vYX1ZtVKYIOhlKC41QCTBRW/Image/2015/01/10922610_10152931243745873_795756949481121475_n-copy-6235a/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="450" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 11" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 11" lb="11"></div><div style="text-align: center;"><span style="font-style: italic; ">Nhiều du khách Hà Nội đã lên đường lên Sa Pa ngay từ đêm qua cùng nhóm bạn để có thể tận mắt chứng kiến cảnh tuyết rơi và ghi lại những hình ảnh đáng nhớ.&nbsp;</span></div><div style="text-align: center;"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_201501101867-9a4fc/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 12" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 12" lb="12"><i>Nhiều du khách đã kịp lên Sa Pa ngay trong đêm.</i></div><div style="text-align: center;"><i></i></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011035502-9a4fc/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 13" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 13" lb="13"></div><div style="text-align: center;"><i>Các thành viên trong gia đình thích thú tạo dáng với tuyết.</i></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_201501106755-9a4fc/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 14" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 14" lb="14"><i>Ai cũng muốn lưu giữ những khoảnh khắc đẹp và hiếm có.</i></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011049591-23205/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 15" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 15" lb="15"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/yAShWn1vYX1ZtVKYIOhlKC41QCTBRW/Image/2015/01/IMG_5953-copy-832fc/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="1000" h="281" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 16" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 16" lb="16"></div><div style="text-align: center;"><span style="font-style: italic; ">Cả vùng núi rộng lớn đều có thể thấy tuyết phủ trắng xoá, tạo nên khung cảnh đẹp mắt.</span></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/JJ5noTccccccccccccwJKetEZPfM4/Image/2015/01/IMG_2015011039172-23205/chum-anh-du-khach-thich-thu-chup-anh-cung-tuyet-trang-o-sa-pa.jpg" w="600" h="400" alt="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 17" title="Chùm ảnh: Du khách thích thú chụp ảnh cùng tuyết trắng ở Sa Pa 17" lb="17"><span style="font-style: italic; ">Cận cảnh từng bông tuyết nhỏ phủ kín một vùng núi rừng.</span></div><div style="text-align: center;"><span style="font-style: italic; "></span></div><div style="text-align: center;">\r\n <div align="center">\r\n <div align="center">\r\n\r\n \r\n \r\n \r\n <p align="justify"><span style="text-align: center; ">Theo Trung tâm dự báo Khí tượng Thuỷ văn Trung ương, khoảng 22h đêm qua, tuyết bắt đầu rơi dày tại khu vực Trạm Tôn, Thác Bạc ở Sa Pa.</span></p><p align="justify"><span style="font-size: 10pt; font-style: italic; "></span></p><p>Hôm nay, nhiệt độ Bắc bộ tiếp tục giảm mạnh, cả vùng chìm trong rét đậm rét hại.&nbsp;</p><p>Do trời lạnh, đường trơn, có mưa lớn, những người thích đi du lịch mong chờ ngắm tuyết cần cẩn trọng khi di chuyển, tránh để xảy ra tai nạn đáng tiếc.</p><p>Ở Hà Nội, hôm nay 10/1, nhiệt độ chỉ còn 10 đến 14 độ C. Đây là dịp cuối tuần có thời tiết khắc nghiệt nhất kể từ đầu mùa đông đến giờ<span style="font-style: italic; ">.</span></p><p></p>\r\n \r\n\r\n \r\n </div>\r\n</div></div><div style="text-align: right;"><span style="font-weight: bold; font-style: italic;">(Ảnh: Doãn Tuấn)</span></div>\r\n', NULL, 'filtered_html'),
