('node', 'article', 0, 7, 7, 'und', 0, '\r\nTrong phim điện ảnh vừa ra mắt <span style="font-weight: bold; font-style: italic;">Chronicle of The Blood Merchant</span>, bất cứ khán giả nào cũng giật mình với tạo hình kém hấp dẫn của diễn viên xinh đẹp&nbsp;Yoon Eun Hye.&nbsp;<div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:dFA1h4NbbYTlOwJMCD6L9pkFEdP9ZY/Image/2015/01/7/B2hrW3NCcAAIYWh-f93ee/yoon-eun-hye-phat-phi-dang-so-trong-phim-moi.jpg" alt="Yoon Eun Hye phát phì đáng sợ trong phim mới 1" title="Yoon Eun Hye phát phì đáng sợ trong phim mới 1" lb="1"></div><div style="text-align: center;"><i>Yoon Eun Hye với vẻ đẹp "nguyên mẫu"</i></div><div style="text-align: center;"></div><div>Vào vai Im Boon Bang, một cô gái trẻ có mối nhân duyên đặc biệt với Heo Sam Gwan (Ha Jung Woo), sau khi kết hôn, Boon Bang trở thành người phụ nữ béo ú tận 100kg. Theo trang naver, Yoon Eun Hye đã phải cần đến sự hỗ trợ của chuyên gia hóa trang. Cô nàng chấp nhận hy sinh dung mạo bắt mắt ngày thường của mình để biến đổi thành một cô gái kém xinh. Được biết thêm, trong phim điện ảnh lần này, cô vào vai một nhân vật có vẻ gần gũi và hiền thục. &nbsp;</div><div style="text-align: center;"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:dFA1h4NbbYTlOwJMCD6L9pkFEdP9ZY/Image/2015/01/7/PAPjkIK-f93ee/yoon-eun-hye-phat-phi-dang-so-trong-phim-moi.jpg" alt="Yoon Eun Hye phát phì đáng sợ trong phim mới 2" title="Yoon Eun Hye phát phì đáng sợ trong phim mới 2" lb="2"></div><div style="text-align: center;"><i>Yoon Eun Hye trong vai Boon Bang béo ú gây sốc</i></div><div style="text-align: center;"><i></i></div><div style="text-align: center;"><i><img src="http://k14.vcmedia.vn/k:thumb_w/600/dFA1h4NbbYTlOwJMCD6L9pkFEdP9ZY/Image/2015/01/7/18117667-663c4/yoon-eun-hye-phat-phi-dang-so-trong-phim-moi.jpg" w="600" h="338" alt="Yoon Eun Hye phát phì đáng sợ trong phim mới 3" title="Yoon Eun Hye phát phì đáng sợ trong phim mới 3" lb="3">Ha Jung Woo - nam chính kiêm đạo diễn phim</i></div><div>Còn Ha Jung Woo, nam chính đồng thời là đạo diễn phim đã xúc động chia sẻ rằng: <i>"Khi tôi mời Yoon Eun Hye vào vai nhân vật người phụ nữ béo tròn Im Boon Bang, người có ngoại hình hoàn toàn đối lập với bản thân, cô ấy đã vui vẻ nhận lời. Mặc dù chỉ là một vai diễn nhỏ nhưng tôi thật đánh giá cao lòng dũng cảm trước thử thách và khả năng ứng biến linh hoạt của nữ diễn viên Yoon Eun Hye".</i> &nbsp;</div><div style="text-align: center;"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/dFA1h4NbbYTlOwJMCD6L9pkFEdP9ZY/Image/2015/01/7/Cartier11_zps156682ba-f93ee/yoon-eun-hye-phat-phi-dang-so-trong-phim-moi.jpg" w="600" h="783" alt="Yoon Eun Hye phát phì đáng sợ trong phim mới 4" title="Yoon Eun Hye phát phì đáng sợ trong phim mới 4" lb="4"></div><div style="text-align: center;"><i>Dù chỉ tham gia với một vai phụ nhưng cô gái này vẫn làm việc với tinh thần vì nghệ thuật rất chuyên nghiệp</i></div><div style="text-align: center;"><i></i></div><div>Phim có nội dung nói về câu chuyện thú vị của chàng Heo Sam Gwan - một người đàn ông của gia đình bỗng nhiên nhận ra mình đã chăm sóc con của người đàn ông khác suốt 11 năm trời. Đây là một phim hài về đề tài gia đình, một chủ đề được điện ảnh Hàn khai thác khá tốt.</div><div style="text-align: center;"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/dFA1h4NbbYTlOwJMCD6L9pkFEdP9ZY/Image/2015/01/7/Chronicle_of_a_Blood_Merchant-p1-f93ee/yoon-eun-hye-phat-phi-dang-so-trong-phim-moi.jpg" w="600" h="854" alt="Yoon Eun Hye phát phì đáng sợ trong phim mới 5" title="Yoon Eun Hye phát phì đáng sợ trong phim mới 5" lb="5"></div><div style="text-align: center;"></div><div>Phim còn có sự tham gia diễn xuất của khá nhiều gương mặt diễn viên đáng chú ý:&nbsp;Ha Jung Woo, Ha Ji Won, Sung Dong Il, Joo Jin Mo,&nbsp;Kim Sung Ryung và nhiều diễn viên khác.</div><div style="text-align: center;"></div><div style="text-align: center;"><img src="http://k14.vcmedia.vn/k:thumb_w/600/dFA1h4NbbYTlOwJMCD6L9pkFEdP9ZY/Image/2015/01/7/1-f93ee/yoon-eun-hye-phat-phi-dang-so-trong-phim-moi.jpg" w="600" h="425" alt="Yoon Eun Hye phát phì đáng sợ trong phim mới 6" title="Yoon Eun Hye phát phì đáng sợ trong phim mới 6" lb="6"><img src="http://k14.vcmedia.vn/k:thumb_w/600/dFA1h4NbbYTlOwJMCD6L9pkFEdP9ZY/Image/2015/01/7/2-f93ee/yoon-eun-hye-phat-phi-dang-so-trong-phim-moi.jpg" w="600" h="417" alt="Yoon Eun Hye phát phì đáng sợ trong phim mới 7" title="Yoon Eun Hye phát phì đáng sợ trong phim mới 7" lb="7"></div><div style="text-align: center;"></div><div><span style="font-weight: bold; font-style: italic;">Chronicle of The Blood Merchant</span> được công chiếu vào ngày 14 tháng 01.&nbsp;</div><div></div></div><div style="text-align: right;">(Nguồn: Naver)</div>\r\n', NULL, 'filtered_html'),
