('node', 'article', 0, 9, 9, 'und', 0, '\n                                    <div class="block_timer_share">\n                                        <div class="block_timer left txt_666">Thứ bảy, 31/1/2015<span class="drash"> | </span>17:11 GMT+7</div>\n                                        <div class="block_share right"><img alt="Chia sẻ bài viết lên facebook" src="http://st.f1.kinhdoanh.vnecdn.net/i/v3/graphics/icon_fb.gif" />\r\n<img alt="Chia sẻ bài viết lên twitter" src="http://st.f1.kinhdoanh.vnecdn.net/i/v3/graphics/icon_tw.gif" />\r\n<img alt="Chia sẻ bài viết lên google+" src="http://st.f1.kinhdoanh.vnecdn.net/i/v3/graphics/icon_google.gif" />\r\n<span class="drash_share">|</span>\r\n    <img alt="Print" src="http://st.f1.kinhdoanh.vnecdn.net/i/v3/graphics/icon_print.gif" alt="Gửi mail cho bạn bè" />\r\n    <img alt="Email" src="http://st.f1.kinhdoanh.vnecdn.net/i/v3/graphics/icon_letter.gif" alt="In bài viết này" /></div>\n                                    </div>\n                                    <div class="div-fbook width_common title_div_fbook">\n                                        <div class="block_timer left txt_666">Thứ bảy, 31/1/2015<span class="drash"> | </span>17:11 GMT+7</div>\n                                    </div>\n                                    <div class="title_news">\n                                        Hàng Tết vào Nam loay hoay gỡ khó\n                                    </div>\n                                    <div class="short_intro txt_666">Thay vì nhập cả chục tấn hàng một lúc, để tránh lỗ các chủ cửa hàng thực phẩm miền Bắc năm nay chỉ lấy theo đơn đặt hàng và ưu tiên các sản phẩm mang lại lợi nhuận cao.</div>\n                                                                        <div class="fck_detail width_common">\n                                        <p class="Normal">\n	Chỉ còn 2 tuần nữa là tới Tết Nguyên đán, nhưng không khí mua bán ở nhiều cửa hàng chuyên kinh doanh thực phẩm miền Bắc tại TP HCM vẫn khá ảm đạm.</p>\n<p class="Normal">\n	Chị Hoa, chủ cửa hàng thực phẩm Hà Nội tại chợ Văn Thánh (Bình Thạnh) cho biết, thời điểm này năm ngoái đã có nhiều khách ghé thì năm nay khá èo uột. Đặc biệt, một số mặt hàng thực phẩm tươi sống khách hàng không còn ưa chuộng. Do đó, nếu lấy hàng dự trữ như mọi năm sẽ rất dễ bị lỗ.</p>\n<p class="Normal">\n	“Thay vì ưu tiên vận chuyển mặt hàng tươi sống, năm nay tôi chỉ lấy bằng một nửa năm ngoái và chỉ nhập theo đơn đặt hàng của khách. Đồng thời, tăng cường lấy các mặt hàng chủ lực có thể giữ được trong thời gian dài như gạo nếp, miến, măng khô, đậu xanh…”, chị Hoa nói.</p>\n\n				<img alt="Cam-1213-1422684420.jpg" src="http://m.f25.img.vnecdn.net/2015/01/31/Cam-1213-1422684420.jpg">\n		\n				<p class="Image">\n					Cam canh được nhiều chủ cửa hàng đồ Bắc tại TP HCM bán dịp Tết năm nay. Ảnh: Hồng Châu.</p>\n			\n		<p class="Normal">\n	Chị cũng cho biết, dịp lễ Tết thì trái cây, những mặt hàng tâm linh dễ kiếm lời hơn so với những mặt hàng khác, lại được khách ưa chuộng. Do vậy, mặt hàng này được chị chú trọng. Mặt khác, để đảm bảo có lãi ổn định thì chỉ nên chọn các mặt hàng trái cây truyền thống và lạ, để được trong thời gian dài như cam canh, bưởi Diễn, phật thủ... Thông thường các loại trái cây này giữ được trong 2-3 tháng.</p>\n<p class="Normal">\n	Ngoài ra, để tiết kiệm chi phí vận chuyển, đối với một số nhóm hàng khô chị chọn cách nhập thông qua đường sắt và bộ, giá cước rẻ hơn 30-40% so với vận chuyển bằng đường hàng không. Chỉ có một số loại giò chả Tết, bánh chưng là đặt gửi qua máy bay.</p>\n<p class="Normal">\n	Cũng nhận thấy thị trường không mấy nhộn nhịp, ông Khánh, chủ cửa hàng thực phẩm Hà Nội trên đường Trần Quốc Toản (quận 3) chia sẻ, năm nay ông quyết định vận chuyển hàng theo ngày. </p>\n<p class="Normal">\n	“Bán đến đâu nhập hàng đến đó chứ không vận chuyển cùng một lúc vài tấn như mọi năm nữa. Bởi lẽ, nếu trữ hàng nhiều mà khách mua ít thì rất dễ bị âm vốn”, ông Khánh nói. Do vậy, cách làm này không chỉ giúp tiêu thụ hàng tốt mà sản phẩm bán ra cũng chất lượng hơn.</p>\n<p class="Normal">\n	Ông Khánh cho biết thêm, ngay cả những sản phẩm mới năm nay là bánh chưng gấc và cốm, ông cũng chỉ nhập khoảng vài chục cái bán với giá ưu đãi để chào hàng. Sau đó, nếu khách hàng ưng ý có thể đặt mua thêm. “Vì là sản phẩm mới nên lãi không cao, chỉ dám làm theo đơn đặt hàng để ổn định và tránh được nguy cơ lỗ”, ông Khánh bộc bạch.</p>\n<p class="Normal">\n	Trong khi đó, chủ cửa hàng thực phẩm Hà Nội trên đường Điện Biên Phủ (quận 1) cho hay, trước tình cảnh thị trường ảm đạm, năm nay ngoài bán lẻ cho khách hàng chị còn tìm các đầu mối mua hàng với số lượng lớn là các cửa hàng, quán ăn Bắc. “Chiết khấu với giá hợp lý cho khách, đồng thời lấy số lượng làm lời sẽ giúp hoạt động kinh doanh tốt hơn”, chủ cửa hàng ở đây chia sẻ.</p>\n<p class="Normal">\n	Chị cũng cho biết, Tết năm nay chị lấy tới 10 tấn bắp cải, hơn một tấn giò và 2-3 tấn bánh trưng cùng với hàng tạ cam canh cùng một số loại trái cây cúng Tết khác.</p>\n<p class="Normal">\n	<span>Theo giới kinh doanh, năm nay giá hàng hóa Tết tại các cửa hàng kinh doanh thực phẩm Hà Nội không biến động so với năm ngoái. P</span><span>hật thủ được bán với giá 150.000-1 triệu đồng một quả; bưởi Diễn 80.000 đồng một trái; cam canh có giá 120.000 đồng một kg; bánh chưng loại 1,2kg giá 120.000 đồng; nếp cái hoa vàng, nếp nương Điện Biên, Sơn La mỗi kg giá 40.000-60.000 đồng....</span></p>\n<p class="Normal" style="text-align:right;">\n	<strong><span>Hồng Châu</span></strong></p>                                    </div>\n                                    \n                                        if (typeof(Parser) != ''undefined'') {\n                                            $(''.vne_video'').each(function(key, val){\n                                                var videoId = $(this).html().trim();\n                                                var vneVideo = ''<div style="text-align:center;"><div class="vne_video">'' + videoId + ''</div></div>'';\n                                                var parentDom = $(this).parent().get(0).tagName;\n                                                var tableDom = $(this).parents(''table'');\n                                                if (parentDom == ''TD'' || parentDom == ''td'') {\n                                                    tableDom.before(vneVideo).remove();\n                                                }\n                                            });\n                                            \n                                            Parser.SITE_URL = ''http://vnexpress.net'';\n                                            Parser.URL = ''http://st.f2.vnecdn.net/responsive/j/v58'';\n                                            Parser.FLASH_URL = ''http://st.f4.vnecdn.net/responsive/f/v15'';\n                                            Parser.AUTO_PLAY = 1;\n                                            Parser.SITE_ID = 1003159;\n                                            Parser.parseAll();\n                                        }\n                                        if (typeof(common.parserAdsFullScreen) != ''undefined'') {\n                                            common.parserAdsFullScreen();\n                                        }\n                                        if (typeof(common.resizeImageDetail) != ''undefined'') {\n                                            common.resizeImageDetail();\n                                            $(window).resize(function() {\n                                                common.delayFireOnce(1000).done(function() {\n                                                    common.resizeImageDetail();\n                                                });\n                                            });\n                                        }\n                                    \n                                    <div class="social_share width_common" id="social_like">\r\n    <div class="item_social" data-component="true" data-component-type="like" data-component-objectid="3141699" data-component-siteid="1003159" data-objecttype="1"></div></div>                                    <div class="clear">&nbsp;</div>\n                                ', NULL, 'filtered_html'),
