('node', 'article', 0, 12, 12, 'und', 0, '\r\n    <div class="box26">\r\n        <div class="breadcrumb">Kinh doanh<img src="http://dantri3.vcmedia.vn/App_Themes/Default/Images/navRow.png" /></div>\r\n        <span class="fr fon7 mr2">\r\n            <meta itemprop="datePublished" content="2015-01-31"/>Thứ Bẩy, 31/01/2015 - 12:02</span>\r\n    </div>\r\n    <p class="detail_subtitle">Bến Tre</p>\r\n    \r\n        Độc chiêu “thổi hồn” cho quất kiểng kiếm tiền triệu \r\n    <div id="like-facebook" class="mt2" style="height: 35px;">\r\n        <div id="fakeLike" style="width: 450px; height: 35px; position: absolute;margin-left: -9px;">\r\n            <img class="fl img_face" src="http://dantri3.vcmedia.vn/App_Themes/Default/Images/fbImage.png"\r\n                alt="thích" style="margin-top: -5px;" />\r\n        </div>\r\n        \r\n    </div>\r\n    \r\n    <h2 class="fon33 mt1 sapo">\r\n        <span>Dân trí</span> Những ngày này, ở “Vương quốc” hoa, kiểng Chợ Lách (Bến Tre) các nghệ nhân đang tất bật “thổi hồn” vào những cây quất (tắc – PV) kiểng tạo thành hình con vật, tháp, hoa sen,… rất độc đáo. Nhờ nghề “hóa phép” này nhiều nghệ nhân kiếm tiền triệu xài Tết.</h2>\r\n    <div class="fon34 mt3 mr2 fon43 detail-content">     \r\n        <P class=MsoNormal>Vùng đất Chợ Lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa, cây kiểng cung ứng cho thị trường trong cả nước. Trong đó, nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được. Đặc biệt nhất là sản phẩm quất kiểng hình bon sai, thú, hoa sen…</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Nhựt đang uốn quất kiểng thành hình tháp" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/1-789d9.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Nhựt đang uốn quất kiểng thành hình tháp</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Những ngày cận Tết, ông Nguyễn Minh Nhựt, ngụ ấp Tây Lộc (Vĩnh Thành, Chợ Lách, Bến Tre) đang tất bật vô chậu, uốn những cây quất kiểng thành hình tháp. Ông Nhựt cho biết: “Tôi làm nghề sản xuất cây giống nhưng năm nào đến Tết cũng làm thêm quất kiểng bỏ mối cho thương lái. Để làm được cây quất bán Tết phải chuẩn bị suốt 1 năm từ trồng cây con, chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/222-75372.JPG" width=299 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV>Theo ông Nhựt, thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán Tết, nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ Long Xuyên (An Giang) tiếp tục bán lẻ. Trung bình mỗi mùa Tết, gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng.</DIV>\r\n<DIV>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/3-0a7e6.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi</SPAN></DIV></SPAN></DIV>\r\n<P></P>\r\n<P class=MsoNormal>Sản phẩm “độc chiêu” các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật. Trong đó, con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm. Năm Ất Mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng/cặp, tùy theo kích cỡ. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/4-dd6fb.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<DIV class=MsoNormal>Ông Lê Văn Bá Tòng ngụ ấp Hòa Lộc (Vĩnh Hòa, Chợ Lách) chuyên uốn quất kiểng thành hình con dê, rồng cho biết: “Năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán. Tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp”. </DIV>\r\n<DIV class=MsoNormal>&nbsp;</DIV>\r\n<DIV class=MsoNormal>Theo ông Tòng, để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật, búp sen hay hình tháp. Do quả quất khi chín màu vàng nên hình rất đẹp.</DIV>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình cá chép" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/13-ebc83.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình cá chép</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ngoài việc tạo dáng quất thành hình con dê, ông Tòng còn làm hình con rồng, hình búp sen bán trong dịp Tết với giá khoảng 4 triệu đồng/cặp. Ông Tòng cho biết: “Tạo dáng quất thành hình con vật, hình tháp đã xuất hiện ở Chợ Lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen. Để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành. Với hình búp sen chuẩn bị nở rất “độc” hy vọng năm nay sẽ đắt hàng”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình rồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/5-b42e3.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình rồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ở làng hoa, kiểng Chợ Lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ, tạo dáng bon sai rồi cho vô chậu bán trong dịp Tết. Những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp. Tết năm nay, ông Nguyễn Văn Thi, ngụ ấp Hòa Khánh (Vĩnh Thành, Chợ Lách) sẽ tung ra thị trường hơn 1.000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng/chậu. Ông Thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận Tết. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Tòng đang hóa phép quất thành hình búp sen" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/6-3a1f7.JPG" width=336 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Tòng đang "hóa phép" quất thành hình búp sen</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/anh-13-1163a.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ông Thi chia sẻ: “Những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu, xử lý cho ra quả đúng vào dịp Tết. Quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng”. Theo nhiều nhà vườn nơi đây, quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn, tạo dáng rồi cho vô chậu bán Tết. Hiện tại nhà vườn Chợ Lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi, dáng bon sai rất đẹp để tung ra thị trường trong dịp Tết.</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/7-a736b.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/8-8e433.JPG" width=290 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/9-9c8a5.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/10-6bd37.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/11-f4f5f.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/12-689ca.JPG" width=299 _fl=""></DIV>\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-SIZE: 10pt"><SPAN style="FONT-FAMILY: Tahoma">Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu</SPAN></SPAN></DIV>\r\n<P class=MsoNormal>Ông Bùi Thanh Liêm, Trưởng Phòng NN&amp;PTNT huyện Chợ Lách cho biết: “Tết Nguyên đán Ất Mùi năm nay nhà vườn huyện Chợ Lách sẽ sản xuất khoảng 3,4 triệu sản phẩm hoa, kiểng. Trong đó chủ lực là mai vàng, quất (tắc) kiểng, vạn thọ, cúc mâm xôi, cúc Đài Loan….”. Sản phẩm từ làng hoa, kiểng Chợ Lách được bán hầu khắp các tỉnh miền Đông, TP Hồ Chí Minh và Đồng bằng Sông Cửu Long. Bằng bàn tay tài hoa của mình, những nghệ nhân nơi đây đã “thổi hồn” vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp Tết.</P>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>Minh Giang&nbsp;</B></DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B></B>&nbsp;</DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>\r\n<P align=center><I><I><IMG alt="Hà Nội: Tận mục bến xe khách ngầm trên “đất vàng”" src="http://dantri4.vcmedia.vn/Ic3EyFHpPWFvMJOJFocc/Image/2014/06/3-47d70.gif" width=460></I></I></P></B></DIV>\r\n\r\n        <div class="news-tag"><div class="news-tag-list"><span class="news-tagname">Xem thêm :</span><span class="news-tags-item">bến tre, dịp tết, tp hồ chí minh, đồng bằng sông cửu long, sản phẩm, nghệ nhân, mai vàng, tạo dáng, thị trường, miền đông</span></div></div>\r\n        \r\n        \r\n        \r\n    </div>\r\n', NULL, 'filtered_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 13, 13, 'und', 0, '<div class="box26"><div class="breadcrumb">Kinh doanh<img src="http://dantri3.vcmedia.vn/App_Themes/Default/Images/navRow.png"></div><span class="fr fon7 mr2"> Thứ Bẩy, 31/01/2015 - 12:02</span></div><p class="detail_subtitle">Bến Tre</p><p>Độc chiêu “thổi hồn” cho quất kiểng kiếm tiền triệu</p><div id="like-facebook" class="mt2" style="height: 35px;"><div id="fakeLike" style="width: 450px; height: 35px; position: absolute; margin-left: -9px;"><img src="http://dantri3.vcmedia.vn/App_Themes/Default/Images/fbImage.png" alt="thích" style="margin-top: -5px;" class="fl img_face"></div></div><h2 class="fon33 mt1 sapo"><span>Dân trí</span> Những ngày này, ở “Vương quốc” hoa, kiểng Chợ Lách (Bến Tre) các nghệ nhân đang tất bật “thổi hồn” vào những cây quất (tắc – PV) kiểng tạo thành hình con vật, tháp, hoa sen,… rất độc đáo. Nhờ nghề “hóa phép” này nhiều nghệ nhân kiếm tiền triệu xài Tết.</h2><div class="fon34 mt3 mr2 fon43 detail-content"><p class="MsoNormal">Vùng đất Chợ Lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa, cây kiểng cung ứng cho thị trường trong cả nước. Trong đó, nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được. Đặc biệt nhất là sản phẩm quất kiểng hình bon sai, thú, hoa sen…</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/1-789d9.JPG" alt="Ông Nhựt đang uốn quất kiểng thành hình tháp" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Ông Nhựt đang uốn quất kiểng thành hình tháp</span></div><p>&nbsp;</p><p class="MsoNormal">Những ngày cận Tết, ông Nguyễn Minh Nhựt, ngụ ấp Tây Lộc (Vĩnh Thành, Chợ Lách, Bến Tre) đang tất bật vô chậu, uốn những cây quất kiểng thành hình tháp. Ông Nhựt cho biết: “Tôi làm nghề sản xuất cây giống nhưng năm nào đến Tết cũng làm thêm quất kiểng bỏ mối cho thương lái. Để làm được cây quất bán Tết phải chuẩn bị suốt 1 năm từ trồng cây con, chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn”.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/222-75372.JPG" alt="Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng" align="center" width="299" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng</span></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div>Theo ông Nhựt, thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán Tết, nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ Long Xuyên (An Giang) tiếp tục bán lẻ. Trung bình mỗi mùa Tết, gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng.</div><div><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/3-0a7e6.JPG" alt="Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi</span></div></div><p>&nbsp;</p><p class="MsoNormal">Sản phẩm “độc chiêu” các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật. Trong đó, con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm. Năm Ất Mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng/cặp, tùy theo kích cỡ.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/4-dd6fb.JPG" alt="Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng</span></div><p>&nbsp;</p><div class="MsoNormal">Ông Lê Văn Bá Tòng ngụ ấp Hòa Lộc (Vĩnh Hòa, Chợ Lách) chuyên uốn quất kiểng thành hình con dê, rồng cho biết: “Năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán. Tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp”.</div><div class="MsoNormal">&nbsp;</div><div class="MsoNormal">Theo ông Tòng, để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật, búp sen hay hình tháp. Do quả quất khi chín màu vàng nên hình rất đẹp.</div><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/13-ebc83.JPG" alt="Quất kiểng hình cá chép" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Quất kiểng hình cá chép</span></div><p>&nbsp;</p><p class="MsoNormal">Ngoài việc tạo dáng quất thành hình con dê, ông Tòng còn làm hình con rồng, hình búp sen bán trong dịp Tết với giá khoảng 4 triệu đồng/cặp. Ông Tòng cho biết: “Tạo dáng quất thành hình con vật, hình tháp đã xuất hiện ở Chợ Lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen. Để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành. Với hình búp sen chuẩn bị nở rất “độc” hy vọng năm nay sẽ đắt hàng”.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/5-b42e3.JPG" alt="Quất kiểng hình rồng" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Quất kiểng hình rồng</span></div><p>&nbsp;</p><p class="MsoNormal">Ở làng hoa, kiểng Chợ Lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ, tạo dáng bon sai rồi cho vô chậu bán trong dịp Tết. Những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp. Tết năm nay, ông Nguyễn Văn Thi, ngụ ấp Hòa Khánh (Vĩnh Thành, Chợ Lách) sẽ tung ra thị trường hơn 1.000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng/chậu. Ông Thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận Tết.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/6-3a1f7.JPG" alt="Ông Tòng đang hóa phép quất thành hình búp sen" align="center" width="336" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Ông Tòng đang "hóa phép" quất thành hình búp sen</span></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/anh-13-1163a.JPG" alt="Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách</span></div><p>&nbsp;</p><p class="MsoNormal">Ông Thi chia sẻ: “Những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu, xử lý cho ra quả đúng vào dịp Tết. Quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng”. Theo nhiều nhà vườn nơi đây, quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn, tạo dáng rồi cho vô chậu bán Tết. Hiện tại nhà vườn Chợ Lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi, dáng bon sai rất đẹp để tung ra thị trường trong dịp Tết.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/7-a736b.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="448" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/8-8e433.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="290" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/9-9c8a5.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="448" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/10-6bd37.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="448" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/11-f4f5f.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="448" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/12-689ca.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="299" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-size: 10pt;"><span style="font-family: Tahoma;">Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu</span></span></div><p class="MsoNormal">Ông Bùi Thanh Liêm, Trưởng Phòng NN&amp;PTNT huyện Chợ Lách cho biết: “Tết Nguyên đán Ất Mùi năm nay nhà vườn huyện Chợ Lách sẽ sản xuất khoảng 3,4 triệu sản phẩm hoa, kiểng. Trong đó chủ lực là mai vàng, quất (tắc) kiểng, vạn thọ, cúc mâm xôi, cúc Đài Loan….”. Sản phẩm từ làng hoa, kiểng Chợ Lách được bán hầu khắp các tỉnh miền Đông, TP Hồ Chí Minh và Đồng bằng Sông Cửu Long. Bằng bàn tay tài hoa của mình, những nghệ nhân nơi đây đã “thổi hồn” vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp Tết.</p><div class="MsoNormal" style="text-align: right;" align="right"><strong>Minh Giang&nbsp;</strong></div><div class="MsoNormal" style="text-align: right;" align="right">&nbsp;</div><div class="MsoNormal" style="text-align: right;" align="right"><p align="center"><em><em><img src="http://dantri4.vcmedia.vn/Ic3EyFHpPWFvMJOJFocc/Image/2014/06/3-47d70.gif" alt="Hà Nội: Tận mục bến xe khách ngầm trên “đất vàng”" width="460"></em></em></p></div><div class="news-tag">&nbsp;</div></div>', '', 'filtered_html'),
('node', 'article', 0, 14, 14, 'und', 0, '     \r\n        <P class=MsoNormal>Vùng đất Chợ Lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa, cây kiểng cung ứng cho thị trường trong cả nước. Trong đó, nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được. Đặc biệt nhất là sản phẩm quất kiểng hình bon sai, thú, hoa sen…</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Nhựt đang uốn quất kiểng thành hình tháp" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/1-789d9.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Nhựt đang uốn quất kiểng thành hình tháp</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Những ngày cận Tết, ông Nguyễn Minh Nhựt, ngụ ấp Tây Lộc (Vĩnh Thành, Chợ Lách, Bến Tre) đang tất bật vô chậu, uốn những cây quất kiểng thành hình tháp. Ông Nhựt cho biết: “Tôi làm nghề sản xuất cây giống nhưng năm nào đến Tết cũng làm thêm quất kiểng bỏ mối cho thương lái. Để làm được cây quất bán Tết phải chuẩn bị suốt 1 năm từ trồng cây con, chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/222-75372.JPG" width=299 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV>Theo ông Nhựt, thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán Tết, nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ Long Xuyên (An Giang) tiếp tục bán lẻ. Trung bình mỗi mùa Tết, gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng.</DIV>\r\n<DIV>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/3-0a7e6.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi</SPAN></DIV></SPAN></DIV>\r\n<P></P>\r\n<P class=MsoNormal>Sản phẩm “độc chiêu” các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật. Trong đó, con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm. Năm Ất Mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng/cặp, tùy theo kích cỡ. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/4-dd6fb.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<DIV class=MsoNormal>Ông Lê Văn Bá Tòng ngụ ấp Hòa Lộc (Vĩnh Hòa, Chợ Lách) chuyên uốn quất kiểng thành hình con dê, rồng cho biết: “Năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán. Tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp”. </DIV>\r\n<DIV class=MsoNormal>&nbsp;</DIV>\r\n<DIV class=MsoNormal>Theo ông Tòng, để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật, búp sen hay hình tháp. Do quả quất khi chín màu vàng nên hình rất đẹp.</DIV>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình cá chép" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/13-ebc83.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình cá chép</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ngoài việc tạo dáng quất thành hình con dê, ông Tòng còn làm hình con rồng, hình búp sen bán trong dịp Tết với giá khoảng 4 triệu đồng/cặp. Ông Tòng cho biết: “Tạo dáng quất thành hình con vật, hình tháp đã xuất hiện ở Chợ Lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen. Để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành. Với hình búp sen chuẩn bị nở rất “độc” hy vọng năm nay sẽ đắt hàng”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình rồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/5-b42e3.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình rồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ở làng hoa, kiểng Chợ Lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ, tạo dáng bon sai rồi cho vô chậu bán trong dịp Tết. Những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp. Tết năm nay, ông Nguyễn Văn Thi, ngụ ấp Hòa Khánh (Vĩnh Thành, Chợ Lách) sẽ tung ra thị trường hơn 1.000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng/chậu. Ông Thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận Tết. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Tòng đang hóa phép quất thành hình búp sen" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/6-3a1f7.JPG" width=336 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Tòng đang "hóa phép" quất thành hình búp sen</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/anh-13-1163a.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ông Thi chia sẻ: “Những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu, xử lý cho ra quả đúng vào dịp Tết. Quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng”. Theo nhiều nhà vườn nơi đây, quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn, tạo dáng rồi cho vô chậu bán Tết. Hiện tại nhà vườn Chợ Lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi, dáng bon sai rất đẹp để tung ra thị trường trong dịp Tết.</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/7-a736b.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/8-8e433.JPG" width=290 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/9-9c8a5.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/10-6bd37.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/11-f4f5f.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/12-689ca.JPG" width=299 _fl=""></DIV>\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-SIZE: 10pt"><SPAN style="FONT-FAMILY: Tahoma">Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu</SPAN></SPAN></DIV>\r\n<P class=MsoNormal>Ông Bùi Thanh Liêm, Trưởng Phòng NN&amp;PTNT huyện Chợ Lách cho biết: “Tết Nguyên đán Ất Mùi năm nay nhà vườn huyện Chợ Lách sẽ sản xuất khoảng 3,4 triệu sản phẩm hoa, kiểng. Trong đó chủ lực là mai vàng, quất (tắc) kiểng, vạn thọ, cúc mâm xôi, cúc Đài Loan….”. Sản phẩm từ làng hoa, kiểng Chợ Lách được bán hầu khắp các tỉnh miền Đông, TP Hồ Chí Minh và Đồng bằng Sông Cửu Long. Bằng bàn tay tài hoa của mình, những nghệ nhân nơi đây đã “thổi hồn” vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp Tết.</P>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>Minh Giang&nbsp;</B></DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B></B>&nbsp;</DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>\r\n<P align=center><I><I><IMG alt="Hà Nội: Tận mục bến xe khách ngầm trên “đất vàng”" src="http://dantri4.vcmedia.vn/Ic3EyFHpPWFvMJOJFocc/Image/2014/06/3-47d70.gif" width=460></I></I></P></B></DIV>\r\n\r\n        <div class="news-tag"><div class="news-tag-list"><span class="news-tagname">Xem thêm :</span><span class="news-tags-item">bến tre, dịp tết, tp hồ chí minh, đồng bằng sông cửu long, sản phẩm, nghệ nhân, mai vàng, tạo dáng, thị trường, miền đông</span></div></div>\r\n        \r\n        \r\n        \r\n    ', NULL, 'filtered_html'),
('node', 'article', 0, 15, 15, 'und', 0, '     \r\n        <P class=MsoNormal>Vùng đất Chợ Lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa, cây kiểng cung ứng cho thị trường trong cả nước. Trong đó, nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được. Đặc biệt nhất là sản phẩm quất kiểng hình bon sai, thú, hoa sen…</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Nhựt đang uốn quất kiểng thành hình tháp" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/1-789d9.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Nhựt đang uốn quất kiểng thành hình tháp</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Những ngày cận Tết, ông Nguyễn Minh Nhựt, ngụ ấp Tây Lộc (Vĩnh Thành, Chợ Lách, Bến Tre) đang tất bật vô chậu, uốn những cây quất kiểng thành hình tháp. Ông Nhựt cho biết: “Tôi làm nghề sản xuất cây giống nhưng năm nào đến Tết cũng làm thêm quất kiểng bỏ mối cho thương lái. Để làm được cây quất bán Tết phải chuẩn bị suốt 1 năm từ trồng cây con, chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/222-75372.JPG" width=299 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV>Theo ông Nhựt, thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán Tết, nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ Long Xuyên (An Giang) tiếp tục bán lẻ. Trung bình mỗi mùa Tết, gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng.</DIV>\r\n<DIV>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/3-0a7e6.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi</SPAN></DIV></SPAN></DIV>\r\n<P></P>\r\n<P class=MsoNormal>Sản phẩm “độc chiêu” các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật. Trong đó, con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm. Năm Ất Mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng/cặp, tùy theo kích cỡ. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/4-dd6fb.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<DIV class=MsoNormal>Ông Lê Văn Bá Tòng ngụ ấp Hòa Lộc (Vĩnh Hòa, Chợ Lách) chuyên uốn quất kiểng thành hình con dê, rồng cho biết: “Năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán. Tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp”. </DIV>\r\n<DIV class=MsoNormal>&nbsp;</DIV>\r\n<DIV class=MsoNormal>Theo ông Tòng, để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật, búp sen hay hình tháp. Do quả quất khi chín màu vàng nên hình rất đẹp.</DIV>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình cá chép" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/13-ebc83.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình cá chép</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ngoài việc tạo dáng quất thành hình con dê, ông Tòng còn làm hình con rồng, hình búp sen bán trong dịp Tết với giá khoảng 4 triệu đồng/cặp. Ông Tòng cho biết: “Tạo dáng quất thành hình con vật, hình tháp đã xuất hiện ở Chợ Lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen. Để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành. Với hình búp sen chuẩn bị nở rất “độc” hy vọng năm nay sẽ đắt hàng”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình rồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/5-b42e3.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình rồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ở làng hoa, kiểng Chợ Lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ, tạo dáng bon sai rồi cho vô chậu bán trong dịp Tết. Những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp. Tết năm nay, ông Nguyễn Văn Thi, ngụ ấp Hòa Khánh (Vĩnh Thành, Chợ Lách) sẽ tung ra thị trường hơn 1.000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng/chậu. Ông Thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận Tết. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Tòng đang hóa phép quất thành hình búp sen" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/6-3a1f7.JPG" width=336 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Tòng đang "hóa phép" quất thành hình búp sen</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/anh-13-1163a.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ông Thi chia sẻ: “Những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu, xử lý cho ra quả đúng vào dịp Tết. Quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng”. Theo nhiều nhà vườn nơi đây, quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn, tạo dáng rồi cho vô chậu bán Tết. Hiện tại nhà vườn Chợ Lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi, dáng bon sai rất đẹp để tung ra thị trường trong dịp Tết.</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/7-a736b.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/8-8e433.JPG" width=290 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/9-9c8a5.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/10-6bd37.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/11-f4f5f.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/12-689ca.JPG" width=299 _fl=""></DIV>\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-SIZE: 10pt"><SPAN style="FONT-FAMILY: Tahoma">Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu</SPAN></SPAN></DIV>\r\n<P class=MsoNormal>Ông Bùi Thanh Liêm, Trưởng Phòng NN&amp;PTNT huyện Chợ Lách cho biết: “Tết Nguyên đán Ất Mùi năm nay nhà vườn huyện Chợ Lách sẽ sản xuất khoảng 3,4 triệu sản phẩm hoa, kiểng. Trong đó chủ lực là mai vàng, quất (tắc) kiểng, vạn thọ, cúc mâm xôi, cúc Đài Loan….”. Sản phẩm từ làng hoa, kiểng Chợ Lách được bán hầu khắp các tỉnh miền Đông, TP Hồ Chí Minh và Đồng bằng Sông Cửu Long. Bằng bàn tay tài hoa của mình, những nghệ nhân nơi đây đã “thổi hồn” vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp Tết.</P>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>Minh Giang&nbsp;</B></DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B></B>&nbsp;</DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>\r\n<P align=center><I><I><IMG alt="Hà Nội: Tận mục bến xe khách ngầm trên “đất vàng”" src="http://dantri4.vcmedia.vn/Ic3EyFHpPWFvMJOJFocc/Image/2014/06/3-47d70.gif" width=460></I></I></P></B></DIV>\r\n\r\n        <div class="news-tag"></div>\r\n        \r\n        \r\n        \r\n    ', NULL, 'filtered_html'),
('node', 'article', 0, 16, 16, 'und', 0, '     \r\n        <P class=MsoNormal>Vùng đất Chợ Lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa, cây kiểng cung ứng cho thị trường trong cả nước. Trong đó, nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được. Đặc biệt nhất là sản phẩm quất kiểng hình bon sai, thú, hoa sen…</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Nhựt đang uốn quất kiểng thành hình tháp" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/1-789d9.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Nhựt đang uốn quất kiểng thành hình tháp</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Những ngày cận Tết, ông Nguyễn Minh Nhựt, ngụ ấp Tây Lộc (Vĩnh Thành, Chợ Lách, Bến Tre) đang tất bật vô chậu, uốn những cây quất kiểng thành hình tháp. Ông Nhựt cho biết: “Tôi làm nghề sản xuất cây giống nhưng năm nào đến Tết cũng làm thêm quất kiểng bỏ mối cho thương lái. Để làm được cây quất bán Tết phải chuẩn bị suốt 1 năm từ trồng cây con, chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/222-75372.JPG" width=299 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV>Theo ông Nhựt, thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán Tết, nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ Long Xuyên (An Giang) tiếp tục bán lẻ. Trung bình mỗi mùa Tết, gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng.</DIV>\r\n<DIV>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/3-0a7e6.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi</SPAN></DIV></SPAN></DIV>\r\n<P></P>\r\n<P class=MsoNormal>Sản phẩm “độc chiêu” các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật. Trong đó, con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm. Năm Ất Mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng/cặp, tùy theo kích cỡ. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/4-dd6fb.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<DIV class=MsoNormal>Ông Lê Văn Bá Tòng ngụ ấp Hòa Lộc (Vĩnh Hòa, Chợ Lách) chuyên uốn quất kiểng thành hình con dê, rồng cho biết: “Năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán. Tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp”. </DIV>\r\n<DIV class=MsoNormal>&nbsp;</DIV>\r\n<DIV class=MsoNormal>Theo ông Tòng, để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật, búp sen hay hình tháp. Do quả quất khi chín màu vàng nên hình rất đẹp.</DIV>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình cá chép" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/13-ebc83.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình cá chép</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ngoài việc tạo dáng quất thành hình con dê, ông Tòng còn làm hình con rồng, hình búp sen bán trong dịp Tết với giá khoảng 4 triệu đồng/cặp. Ông Tòng cho biết: “Tạo dáng quất thành hình con vật, hình tháp đã xuất hiện ở Chợ Lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen. Để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành. Với hình búp sen chuẩn bị nở rất “độc” hy vọng năm nay sẽ đắt hàng”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình rồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/5-b42e3.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình rồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ở làng hoa, kiểng Chợ Lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ, tạo dáng bon sai rồi cho vô chậu bán trong dịp Tết. Những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp. Tết năm nay, ông Nguyễn Văn Thi, ngụ ấp Hòa Khánh (Vĩnh Thành, Chợ Lách) sẽ tung ra thị trường hơn 1.000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng/chậu. Ông Thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận Tết. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Tòng đang hóa phép quất thành hình búp sen" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/6-3a1f7.JPG" width=336 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Tòng đang "hóa phép" quất thành hình búp sen</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/anh-13-1163a.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ông Thi chia sẻ: “Những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu, xử lý cho ra quả đúng vào dịp Tết. Quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng”. Theo nhiều nhà vườn nơi đây, quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn, tạo dáng rồi cho vô chậu bán Tết. Hiện tại nhà vườn Chợ Lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi, dáng bon sai rất đẹp để tung ra thị trường trong dịp Tết.</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/7-a736b.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/8-8e433.JPG" width=290 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/9-9c8a5.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/10-6bd37.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/11-f4f5f.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/12-689ca.JPG" width=299 _fl=""></DIV>\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-SIZE: 10pt"><SPAN style="FONT-FAMILY: Tahoma">Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu</SPAN></SPAN></DIV>\r\n<P class=MsoNormal>Ông Bùi Thanh Liêm, Trưởng Phòng NN&amp;PTNT huyện Chợ Lách cho biết: “Tết Nguyên đán Ất Mùi năm nay nhà vườn huyện Chợ Lách sẽ sản xuất khoảng 3,4 triệu sản phẩm hoa, kiểng. Trong đó chủ lực là mai vàng, quất (tắc) kiểng, vạn thọ, cúc mâm xôi, cúc Đài Loan….”. Sản phẩm từ làng hoa, kiểng Chợ Lách được bán hầu khắp các tỉnh miền Đông, TP Hồ Chí Minh và Đồng bằng Sông Cửu Long. Bằng bàn tay tài hoa của mình, những nghệ nhân nơi đây đã “thổi hồn” vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp Tết.</P>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>Minh Giang&nbsp;</B></DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B></B>&nbsp;</DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>\r\n<P align=center><I><I><IMG alt="Hà Nội: Tận mục bến xe khách ngầm trên “đất vàng”" src="http://dantri4.vcmedia.vn/Ic3EyFHpPWFvMJOJFocc/Image/2014/06/3-47d70.gif" width=460></I></I></P></B></DIV>\r\n\r\n        <div class="news-tag"></div>\r\n        \r\n        \r\n        \r\n    ', NULL, 'filtered_html');
