('node', 'article', 0, 17, 17, 'und', 0, '     \r\n        <P class=MsoNormal>Vùng đất Chợ Lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa, cây kiểng cung ứng cho thị trường trong cả nước. Trong đó, nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được. Đặc biệt nhất là sản phẩm quất kiểng hình bon sai, thú, hoa sen…</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Nhựt đang uốn quất kiểng thành hình tháp" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/1-789d9.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Nhựt đang uốn quất kiểng thành hình tháp</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Những ngày cận Tết, ông Nguyễn Minh Nhựt, ngụ ấp Tây Lộc (Vĩnh Thành, Chợ Lách, Bến Tre) đang tất bật vô chậu, uốn những cây quất kiểng thành hình tháp. Ông Nhựt cho biết: “Tôi làm nghề sản xuất cây giống nhưng năm nào đến Tết cũng làm thêm quất kiểng bỏ mối cho thương lái. Để làm được cây quất bán Tết phải chuẩn bị suốt 1 năm từ trồng cây con, chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/222-75372.JPG" width=299 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV>Theo ông Nhựt, thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán Tết, nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ Long Xuyên (An Giang) tiếp tục bán lẻ. Trung bình mỗi mùa Tết, gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng.</DIV>\r\n<DIV>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/3-0a7e6.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi</SPAN></DIV></SPAN></DIV>\r\n<P></P>\r\n<P class=MsoNormal>Sản phẩm “độc chiêu” các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật. Trong đó, con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm. Năm Ất Mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng/cặp, tùy theo kích cỡ. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/4-dd6fb.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<DIV class=MsoNormal>Ông Lê Văn Bá Tòng ngụ ấp Hòa Lộc (Vĩnh Hòa, Chợ Lách) chuyên uốn quất kiểng thành hình con dê, rồng cho biết: “Năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán. Tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp”. </DIV>\r\n<DIV class=MsoNormal>&nbsp;</DIV>\r\n<DIV class=MsoNormal>Theo ông Tòng, để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật, búp sen hay hình tháp. Do quả quất khi chín màu vàng nên hình rất đẹp.</DIV>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình cá chép" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/13-ebc83.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình cá chép</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ngoài việc tạo dáng quất thành hình con dê, ông Tòng còn làm hình con rồng, hình búp sen bán trong dịp Tết với giá khoảng 4 triệu đồng/cặp. Ông Tòng cho biết: “Tạo dáng quất thành hình con vật, hình tháp đã xuất hiện ở Chợ Lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen. Để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành. Với hình búp sen chuẩn bị nở rất “độc” hy vọng năm nay sẽ đắt hàng”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình rồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/5-b42e3.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình rồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ở làng hoa, kiểng Chợ Lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ, tạo dáng bon sai rồi cho vô chậu bán trong dịp Tết. Những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp. Tết năm nay, ông Nguyễn Văn Thi, ngụ ấp Hòa Khánh (Vĩnh Thành, Chợ Lách) sẽ tung ra thị trường hơn 1.000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng/chậu. Ông Thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận Tết. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Tòng đang hóa phép quất thành hình búp sen" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/6-3a1f7.JPG" width=336 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Tòng đang "hóa phép" quất thành hình búp sen</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/anh-13-1163a.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ông Thi chia sẻ: “Những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu, xử lý cho ra quả đúng vào dịp Tết. Quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng”. Theo nhiều nhà vườn nơi đây, quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn, tạo dáng rồi cho vô chậu bán Tết. Hiện tại nhà vườn Chợ Lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi, dáng bon sai rất đẹp để tung ra thị trường trong dịp Tết.</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/7-a736b.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/8-8e433.JPG" width=290 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/9-9c8a5.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/10-6bd37.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/11-f4f5f.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/12-689ca.JPG" width=299 _fl=""></DIV>\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-SIZE: 10pt"><SPAN style="FONT-FAMILY: Tahoma">Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu</SPAN></SPAN></DIV>\r\n<P class=MsoNormal>Ông Bùi Thanh Liêm, Trưởng Phòng NN&amp;PTNT huyện Chợ Lách cho biết: “Tết Nguyên đán Ất Mùi năm nay nhà vườn huyện Chợ Lách sẽ sản xuất khoảng 3,4 triệu sản phẩm hoa, kiểng. Trong đó chủ lực là mai vàng, quất (tắc) kiểng, vạn thọ, cúc mâm xôi, cúc Đài Loan….”. Sản phẩm từ làng hoa, kiểng Chợ Lách được bán hầu khắp các tỉnh miền Đông, TP Hồ Chí Minh và Đồng bằng Sông Cửu Long. Bằng bàn tay tài hoa của mình, những nghệ nhân nơi đây đã “thổi hồn” vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp Tết.</P>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>Minh Giang&nbsp;</B></DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B></B>&nbsp;</DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>\r\n<P align=center><I><I><IMG alt="Hà Nội: Tận mục bến xe khách ngầm trên “đất vàng”" src="http://dantri4.vcmedia.vn/Ic3EyFHpPWFvMJOJFocc/Image/2014/06/3-47d70.gif" width=460></I></I></P></B></DIV>\r\n\r\n        <div class="news-tag"></div>\r\n        \r\n        \r\n        \r\n    ', NULL, 'filtered_html'),
('node', 'article', 0, 18, 18, 'und', 0, '     \r\n        <P class=MsoNormal>Vùng đất Chợ Lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa, cây kiểng cung ứng cho thị trường trong cả nước. Trong đó, nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được. Đặc biệt nhất là sản phẩm quất kiểng hình bon sai, thú, hoa sen…</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Nhựt đang uốn quất kiểng thành hình tháp" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/1-789d9.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Nhựt đang uốn quất kiểng thành hình tháp</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Những ngày cận Tết, ông Nguyễn Minh Nhựt, ngụ ấp Tây Lộc (Vĩnh Thành, Chợ Lách, Bến Tre) đang tất bật vô chậu, uốn những cây quất kiểng thành hình tháp. Ông Nhựt cho biết: “Tôi làm nghề sản xuất cây giống nhưng năm nào đến Tết cũng làm thêm quất kiểng bỏ mối cho thương lái. Để làm được cây quất bán Tết phải chuẩn bị suốt 1 năm từ trồng cây con, chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/222-75372.JPG" width=299 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV>Theo ông Nhựt, thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán Tết, nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ Long Xuyên (An Giang) tiếp tục bán lẻ. Trung bình mỗi mùa Tết, gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng.</DIV>\r\n<DIV>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/3-0a7e6.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi</SPAN></DIV></SPAN></DIV>\r\n<P></P>\r\n<P class=MsoNormal>Sản phẩm “độc chiêu” các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật. Trong đó, con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm. Năm Ất Mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng/cặp, tùy theo kích cỡ. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/4-dd6fb.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<DIV class=MsoNormal>Ông Lê Văn Bá Tòng ngụ ấp Hòa Lộc (Vĩnh Hòa, Chợ Lách) chuyên uốn quất kiểng thành hình con dê, rồng cho biết: “Năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán. Tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp”. </DIV>\r\n<DIV class=MsoNormal>&nbsp;</DIV>\r\n<DIV class=MsoNormal>Theo ông Tòng, để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật, búp sen hay hình tháp. Do quả quất khi chín màu vàng nên hình rất đẹp.</DIV>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình cá chép" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/13-ebc83.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình cá chép</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ngoài việc tạo dáng quất thành hình con dê, ông Tòng còn làm hình con rồng, hình búp sen bán trong dịp Tết với giá khoảng 4 triệu đồng/cặp. Ông Tòng cho biết: “Tạo dáng quất thành hình con vật, hình tháp đã xuất hiện ở Chợ Lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen. Để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành. Với hình búp sen chuẩn bị nở rất “độc” hy vọng năm nay sẽ đắt hàng”. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình rồng" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/5-b42e3.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình rồng</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ở làng hoa, kiểng Chợ Lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ, tạo dáng bon sai rồi cho vô chậu bán trong dịp Tết. Những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp. Tết năm nay, ông Nguyễn Văn Thi, ngụ ấp Hòa Khánh (Vĩnh Thành, Chợ Lách) sẽ tung ra thị trường hơn 1.000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng/chậu. Ông Thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận Tết. </P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Ông Tòng đang hóa phép quất thành hình búp sen" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/6-3a1f7.JPG" width=336 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Ông Tòng đang "hóa phép" quất thành hình búp sen</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/anh-13-1163a.JPG" width=448 _fl=""></DIV><SPAN style="FONT-SIZE: 10pt">\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-FAMILY: Tahoma; FONT-SIZE: 10pt">Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách</SPAN></DIV></SPAN>\r\n<P></P>\r\n<P class=MsoNormal>Ông Thi chia sẻ: “Những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu, xử lý cho ra quả đúng vào dịp Tết. Quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng”. Theo nhiều nhà vườn nơi đây, quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn, tạo dáng rồi cho vô chậu bán Tết. Hiện tại nhà vườn Chợ Lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi, dáng bon sai rất đẹp để tung ra thị trường trong dịp Tết.</P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/7-a736b.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/8-8e433.JPG" width=290 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/9-9c8a5.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/10-6bd37.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/11-f4f5f.JPG" width=448 _fl=""></DIV>\r\n<P></P>\r\n<P class=MsoNormal></P>\r\n<DIV style="TEXT-ALIGN: center"><IMG style="MARGIN: 5px" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align=center src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/12-689ca.JPG" width=299 _fl=""></DIV>\r\n<DIV style="TEXT-ALIGN: center"><SPAN style="FONT-SIZE: 10pt"><SPAN style="FONT-FAMILY: Tahoma">Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu</SPAN></SPAN></DIV>\r\n<P class=MsoNormal>Ông Bùi Thanh Liêm, Trưởng Phòng NN&amp;PTNT huyện Chợ Lách cho biết: “Tết Nguyên đán Ất Mùi năm nay nhà vườn huyện Chợ Lách sẽ sản xuất khoảng 3,4 triệu sản phẩm hoa, kiểng. Trong đó chủ lực là mai vàng, quất (tắc) kiểng, vạn thọ, cúc mâm xôi, cúc Đài Loan….”. Sản phẩm từ làng hoa, kiểng Chợ Lách được bán hầu khắp các tỉnh miền Đông, TP Hồ Chí Minh và Đồng bằng Sông Cửu Long. Bằng bàn tay tài hoa của mình, những nghệ nhân nơi đây đã “thổi hồn” vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp Tết.</P>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>Minh Giang&nbsp;</B></DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B></B>&nbsp;</DIV>\r\n<DIV style="TEXT-ALIGN: right" class=MsoNormal align=right><B>\r\n<P align=center><I><I><IMG alt="Hà Nội: Tận mục bến xe khách ngầm trên “đất vàng”" src="http://dantri4.vcmedia.vn/Ic3EyFHpPWFvMJOJFocc/Image/2014/06/3-47d70.gif" width=460></I></I></P></B></DIV>\r\n\r\n        <div class="news-tag"></div>\r\n        \r\n        \r\n        \r\n    ', NULL, 'filtered_html'),
('node', 'article', 0, 19, 19, 'und', 0, '<p class="MsoNormal">Vùng đất Chợ Lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa, cây kiểng cung ứng cho thị trường trong cả nước. Trong đó, nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được. Đặc biệt nhất là sản phẩm quất kiểng hình bon sai, thú, hoa sen…</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/1-789d9.JPG" alt="Ông Nhựt đang uốn quất kiểng thành hình tháp" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Ông Nhựt đang uốn quất kiểng thành hình tháp</span></div><p>&nbsp;</p><p class="MsoNormal">Những ngày cận Tết, ông Nguyễn Minh Nhựt, ngụ ấp Tây Lộc (Vĩnh Thành, Chợ Lách, Bến Tre) đang tất bật vô chậu, uốn những cây quất kiểng thành hình tháp. Ông Nhựt cho biết: “Tôi làm nghề sản xuất cây giống nhưng năm nào đến Tết cũng làm thêm quất kiểng bỏ mối cho thương lái. Để làm được cây quất bán Tết phải chuẩn bị suốt 1 năm từ trồng cây con, chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn”.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/222-75372.JPG" alt="Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng" align="center" width="299" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng</span></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div>Theo ông Nhựt, thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán Tết, nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ Long Xuyên (An Giang) tiếp tục bán lẻ. Trung bình mỗi mùa Tết, gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng.</div><div><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/3-0a7e6.JPG" alt="Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Nghệ nhân đang biến quất thành hình dê phục vụ tết Ất Mùi</span></div></div><p>&nbsp;</p><p class="MsoNormal">Sản phẩm “độc chiêu” các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật. Trong đó, con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm. Năm Ất Mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng/cặp, tùy theo kích cỡ.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/4-dd6fb.JPG" alt="Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Vườn quất kiểng hình dê, rồng, búp sen của ông Tòng</span></div><p>&nbsp;</p><div class="MsoNormal">Ông Lê Văn Bá Tòng ngụ ấp Hòa Lộc (Vĩnh Hòa, Chợ Lách) chuyên uốn quất kiểng thành hình con dê, rồng cho biết: “Năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán. Tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp”.</div><div class="MsoNormal">&nbsp;</div><div class="MsoNormal">Theo ông Tòng, để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật, búp sen hay hình tháp. Do quả quất khi chín màu vàng nên hình rất đẹp.</div><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/13-ebc83.JPG" alt="Quất kiểng hình cá chép" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Quất kiểng hình cá chép</span></div><p>&nbsp;</p><p class="MsoNormal">Ngoài việc tạo dáng quất thành hình con dê, ông Tòng còn làm hình con rồng, hình búp sen bán trong dịp Tết với giá khoảng 4 triệu đồng/cặp. Ông Tòng cho biết: “Tạo dáng quất thành hình con vật, hình tháp đã xuất hiện ở Chợ Lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen. Để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành. Với hình búp sen chuẩn bị nở rất “độc” hy vọng năm nay sẽ đắt hàng”.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/5-b42e3.JPG" alt="Quất kiểng hình rồng" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Quất kiểng hình rồng</span></div><p>&nbsp;</p><p class="MsoNormal">Ở làng hoa, kiểng Chợ Lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ, tạo dáng bon sai rồi cho vô chậu bán trong dịp Tết. Những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp. Tết năm nay, ông Nguyễn Văn Thi, ngụ ấp Hòa Khánh (Vĩnh Thành, Chợ Lách) sẽ tung ra thị trường hơn 1.000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng/chậu. Ông Thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận Tết.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/6-3a1f7.JPG" alt="Ông Tòng đang hóa phép quất thành hình búp sen" align="center" width="336" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Ông Tòng đang "hóa phép" quất thành hình búp sen</span></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/anh-13-1163a.JPG" alt="Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách" align="center" width="448" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-family: Tahoma; font-size: 10pt;">Quất kiểng hình tháp, bình hoa là sản phẩm độc đáo của làng hoa Chợ Lách</span></div><p>&nbsp;</p><p class="MsoNormal">Ông Thi chia sẻ: “Những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu, xử lý cho ra quả đúng vào dịp Tết. Quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng”. Theo nhiều nhà vườn nơi đây, quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn, tạo dáng rồi cho vô chậu bán Tết. Hiện tại nhà vườn Chợ Lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi, dáng bon sai rất đẹp để tung ra thị trường trong dịp Tết.</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/7-a736b.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="448" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/8-8e433.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="290" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/9-9c8a5.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="448" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/10-6bd37.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="448" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/11-f4f5f.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="448" style="margin: 5px;"></div><p>&nbsp;</p><p class="MsoNormal">&nbsp;</p><div style="text-align: center;"><img src="http://dantri4.vcmedia.vn/BWExREDI3pyCudfOD5KSDuMSuM39cc/Image/2015/01/12-689ca.JPG" alt="Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu" align="center" width="299" style="margin: 5px;"></div><div style="text-align: center;"><span style="font-size: 10pt;"><span style="font-family: Tahoma;">Quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng/chậu</span></span></div><p class="MsoNormal">Ông Bùi Thanh Liêm, Trưởng Phòng NN&amp;PTNT huyện Chợ Lách cho biết: “Tết Nguyên đán Ất Mùi năm nay nhà vườn huyện Chợ Lách sẽ sản xuất khoảng 3,4 triệu sản phẩm hoa, kiểng. Trong đó chủ lực là mai vàng, quất (tắc) kiểng, vạn thọ, cúc mâm xôi, cúc Đài Loan….”. Sản phẩm từ làng hoa, kiểng Chợ Lách được bán hầu khắp các tỉnh miền Đông, TP Hồ Chí Minh và Đồng bằng Sông Cửu Long. Bằng bàn tay tài hoa của mình, những nghệ nhân nơi đây đã “thổi hồn” vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp Tết.</p><div class="MsoNormal" style="text-align: right;" align="right"><strong>Minh Giang&nbsp;</strong></div><div class="MsoNormal" style="text-align: right;" align="right">&nbsp;</div>', '', 'filtered_html'),
('node', 'article', 0, 20, 20, 'und', 0, '     \r\n        <DIV>Số liệu từ Bộ Lao động - Thương binh và Xã hội cho biết, tới giữa tháng 1/2015 phần lớn các doanh nghiệp, đơn vị trên cả nước đã có kế hoạch thưởng Tết cho nhân viên, với mức bình quân là 5 triệu đồng/người. Trước đó, đã có hơn 80% doanh nghiệp thưởng Tết Dương lịch cho nhân viên với khoảng 1,5 triệu đồng/người.</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=left>\r\n<DIV><IMG style="MARGIN: 5px" alt="Khó có bức tranh chính xác" align=center src="http://dantri4.vcmedia.vn/dTHzKeVAx8f0ulMfFGv8PacAmpccc/Image/2015/01/ThuongTet311-f0ded.jpg" width=450 _fl=""><B>Khó có bức tranh chính xác</B>\r\n\r\n\r\n\r\n\r\n<DIV style="LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt; mso-element: frame; mso-element-frame-hspace: 2.25pt; mso-element-wrap: around; mso-element-anchor-vertical: paragraph; mso-element-anchor-horizontal: page; mso-element-left: right; mso-element-top: 159.8pt; mso-height-rule: exactly" class=MsoNormal><B><SPAN style="FONT-FAMILY: ''Arial'',''sans-serif''; COLOR: black; FONT-SIZE: 10pt; mso-fareast-font-family: ''Times New Roman''">Đọc những thông tin kinh tế - tài chính mới nhất trên&nbsp;<A href="http://fica.vn/"><SPAN style="COLOR: mediumblue; mso-bidi-font-size: 11.0pt">FICA</SPAN></A>:</SPAN></B><SPAN style="mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-size: 12.0pt; mso-bidi-font-family: ''Times New Roman''">&nbsp;&nbsp;</SPAN></DIV>\r\n<DIV style="LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt; mso-element: frame; mso-element-frame-hspace: 2.25pt; mso-element-wrap: around; mso-element-anchor-vertical: paragraph; mso-element-anchor-horizontal: page; mso-element-left: right; mso-element-top: 159.8pt; mso-height-rule: exactly" class=MsoNormal><SPAN style="mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-size: 12.0pt; mso-bidi-font-family: ''Times New Roman''"></SPAN>&nbsp;</DIV>\r\n<DIV style="LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt" class=MsoNormal><SPAN style="FONT-FAMILY: ''Arial'',''sans-serif''; FONT-SIZE: 10pt; mso-fareast-font-family: ''Times New Roman''">*&nbsp;<A title="Người tiêu dùng e ngại, táo nhập khẩu liêu xiêu" href="http://fica.vn/tien-va-hang/nguoi-tieu-dung-e-ngai-tao-nhap-khau-lieu-xieu-26262.html" data-npi="21112"><SPAN style="COLOR: #0000cd">Người tiêu dùng e ngại, táo nhập khẩu liêu xiêu</SPAN></A><SPAN style="COLOR: #0000cd">&nbsp;</SPAN></SPAN></DIV>\r\n<DIV style="LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt" class=MsoNormal><SPAN style="FONT-FAMILY: ''Arial'',''sans-serif''; COLOR: #0000cd; FONT-SIZE: 10pt; mso-fareast-font-family: ''Times New Roman''"><SPAN style="COLOR: #0000cd">*&nbsp;</SPAN><A title="Bơm thêm 50.000 tỉ đồng cho bất động sản" href="http://fica.vn/bat-dong-san/bom-them-50.000-ti-dong-cho-bat-dong-san-26261.html" data-npi="21111"><SPAN style="COLOR: #0000cd">Bơm thêm 50.000 tỉ đồng cho bất động sản</SPAN></A><SPAN style="COLOR: #0000cd">&nbsp;</SPAN></SPAN></DIV>\r\n<DIV style="LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt" class=MsoNormal><SPAN style="FONT-FAMILY: ''Arial'',''sans-serif''; COLOR: #0000cd; FONT-SIZE: 10pt; mso-fareast-font-family: ''Times New Roman''"><SPAN style="COLOR: #0000cd">*&nbsp;</SPAN><A title=''Những "làng đồng nát" bạc tỉ: Bới vàng trong "rác"'' href="http://fica.vn/doi-song/nhung-lang-dong-nat-bac-ti-boi-vang-trong-rac--26260.html" data-npi="21110"><SPAN style="COLOR: #0000cd">Những "làng đồng nát" bạc tỉ: Bới vàng trong "rác"</SPAN></A><SPAN style="COLOR: #0000cd">&nbsp;</SPAN></SPAN></DIV>\r\n<DIV style="LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt" class=MsoNormal><SPAN style="FONT-FAMILY: ''Arial'',''sans-serif''; COLOR: #0000cd; FONT-SIZE: 10pt; mso-fareast-font-family: ''Times New Roman''"><SPAN style="COLOR: #0000cd">* &nbsp;</SPAN><A title="Hàng trăm hãng taxi đồng loạt giảm cước" href="http://fica.vn/tien-va-hang/hang-tram-hang-taxi-dong-loat-giam-cuoc-26259.html" data-npi="21109"><SPAN style="COLOR: #0000cd">Hàng trăm hãng taxi đồng loạt giảm cước</SPAN></A><SPAN style="COLOR: #0000cd">&nbsp;</SPAN></SPAN></DIV>\r\n<DIV style="LINE-HEIGHT: normal; MARGIN: 0in 0in 0pt" class=MsoNormal><SPAN style="FONT-FAMILY: ''Arial'',''sans-serif''; COLOR: #0000cd; FONT-SIZE: 10pt; mso-fareast-font-family: ''Times New Roman''"><SPAN style="COLOR: #0000cd">*&nbsp;</SPAN><A title="Thế giới Di động lên mục tiêu vượt 1 tỷ USD doanh thu năm 2015" href="http://fica.vn/doanh-nghiep/the-gioi-di-dong-len-muc-tieu-vuot-1-ty-usd-doanh-thu-nam-2015-26258.html" data-npi="21108"><SPAN style="COLOR: #0000cd">Thế giới Di động lên mục tiêu vượt 1 tỷ USD doanh thu năm 2015</SPAN></A><SPAN style="COLOR: #0000cd"></SPAN></SPAN></DIV>Thống kê mới nhất cho thấy, kỷ lục thưởng Tết năm nay thuộc về doanh nghiệp tại Tp.HCM với mức thưởng Tết Dương lịch là 583 triệu đồng và doanh nghiệp FDI tại Bình Dương với mức thưởng Tết Nguyên đán Ất Mùi là 482 triệu đồng.Trong khi đó, mức thưởng Tết cao nhất tại Hà Nội chỉ là 85,6 triệu đồng. So với năm ngoái là 709 triệu đồng, mức thưởng cao nhất còn thua khá xa. Nếu chia bình quân thì theo Bộ Lao động - Thương binh và Xã hội, mức thưởng năm nay khoảng 5 triệu đồng/người, tương đương 1 tháng lương của người lao động.Tuy nhiên, con số 13.000 doanh nghiệp được khảo sát chỉ chiếm khoảng 3% tổng số doanh nghiệp trên cả nước, nên khó lòng coi con số 5 triệu đồng tiền thưởng bình quân nói trên là mức đại diện mà tất cả người lao động được hưởng. Một thực tế tồn tại từ nhiều năm, đó là chỉ những doanh nghiệp có mức thưởng Tết tạm ổn thì mới báo cáo lên cơ quan quản lý nhà nước. Do vậy sẽ rất khó có một bức tranh chính xác về tình hình thưởng Tết ở tất cả mọi doanh nghiệp, cơ quan, đơn vị. Bên cạnh những doanh nghiệp có mức thưởng cao ngất ngưởng, còn nhiều doanh nghiệp chỉ thưởng cho người lao động những khoản tiền hết sức tượng trưng.Ví dụ, một doanh nghiệp tư nhân ở phía Nam thưởng Tết với mức 30.000 đồng/người, được cho là mức thấp nhất. Qua khảo sát tại một số địa phương, vẫn còn không ít doanh nghiệp, đơn vị chỉ thưởng bằng hiện vật “cây nhà lá vườn”, hoặc thậm chí không có thưởng!Ngay trong nội bộ một ngành cũng có sự phân hóa rất mạnh về khoản thưởng Tết.Đơn cử như ngành giáo dục, mức thưởng Tết cho cán bộ, giảng viên các đại học năm nay khá cao. Giữ kỷ lục thưởng Tết cao nhất trong khối các trường tới thời điểm này là Đại học Công nghệ Tp.HCM, với mức hơn 100 triệu đồng/người. Đại học Lạc Hồng (Đồng Nai) cũng thưởng tới 60 triệu đồng.Ở khối đại học công lập, mức thưởng cũng từ 8-20 triệu đồng/người. Trong khi đó, mức thưởng Tết cho giáo viên tại tỉnh Nghệ An dao động 500.000 - 600.000 đồng/người đối với khối trung học phổ thông và các trung tâm giáo dục thường xuyên. Riêng khối trường mầm non, tiểu học, trung học cơ sở thì chỉ thưởng giáo viên vẻn vẹn 100.000 đồng. Ngoài hai trường không thưởng Tết, còn có một vài trường nợ lương giáo viên từ 1 - 2 tháng.<B>Người ăn Tết to, kẻ lo... không có Tết!</B>Ông Cao Sỹ Kiêm, Ủy viên Ủy ban Kinh tế Quốc hội đánh giá: “Tình hình thưởng Tết vẫn không khả quan. Mặc dù kinh tế có hồi phục, tuy nhiên doanh số và lợi nhuận của nhiều doanh nghiệp vẫn chưa tốt. Mức thưởng Tết cao vẫn có nhưng mức trung bình và thấp còn nhiều”.Do chế độ thưởng Tết hiện chưa được luật hóa, nên việc thưởng hay không thưởng, thưởng nhiều hay ít đều chỉ phụ thuộc vào hảo tâm của người sử dụng lao động, hoặc tốt hơn thì tùy thuộc vào những thỏa thuận giữa giới chủ với người lao động. Dù vậy, thưởng Tết lâu nay vẫn được mặc nhiên coi như một tập quán để giới chủ, người sử dụng lao động bày tỏ sự cảm ơn đối với người lao động, những cộng sự đã cùng chung sức vượt qua khó khăn trong suốt cả một năm. Với quy định thưởng Tết căn cứ vào hiệu quả hoạt động sản xuất kinh doanh trong năm, các chủ doanh nghiệp hoàn toàn nắm thế chủ động trong việc quyết định mức thưởng. Với cơ chế như hiện nay, người lao động không thể đòi hỏi sự minh bạch và công khai về tình hình tài chính. Do đó, họ không có căn cứ để đòi hỏi một mức thưởng Tết tương xứng.Đáng chú ý, hiện không ít chuyên gia đã đề xuất cần luật hóa vấn đề thưởng Tết.Bà Phạm Thị Hải Chuyền, Bộ trưởng Bộ Lao động - Thương binh và Xã hội lưu ý: theo quy định pháp luật thì thưởng Tết không phải là một khoản bắt buộc, đây là khoản khuyến khích. Nhưng tuyệt đại bộ phận các doanh nghiệp khi làm ăn được đều có phương án lương thưởng. Theo Bộ trưởng, nếu đến thời điểm này vẫn chưa có thông tin, trước tiên người lao động nên kiểm tra lại xem trong hợp đồng đã ký có khoản thưởng hay không, khoản thưởng đó có công khai ở nơi làm việc không. Nếu có mà chưa thực hiện thì cần phản ánh với công đoàn để đôn đốc chủ doanh nghiệp thực hiện. Trường hợp đã có trong quy chế mà chủ doanh nghiệp không thực hiện thì cần báo cáo với sở hoặc phòng lao động - thương binh và xã hội địa phương nơi doanh nghiệp đóng, để can thiệp theo đúng quy chế của doanh nghiệp về vấn đề lương thưởng trong hợp đồng với người lao động. </DIV></DIV>\r\n<DIV align=right>&nbsp;</DIV>\r\n<DIV align=right>Theo <STRONG>Việt Huy</STRONG></DIV>\r\n<DIV align=right>VnEconomy</DIV>\r\n<DIV align=right>&nbsp;</DIV>\r\n<DIV align=right>\r\n<P align=center><I><I><A href="http://www.fica.vn/"></A></I></I></P></DIV>\r\n\r\n        <div class="news-tag"></div>\r\n        \r\n        \r\n        \r\n    ', NULL, 'filtered_html'),
('node', 'article', 0, 21, 21, 'und', 0, '\n                                        <p class="Normal">\n	Giá này tương đương 33,04 triệu đồng một lượng chưa thuế phí. Thị trường trong nước hôm qua đóng cửa quanh 35,24-35,34 triệu đồng. <span>Dù vậy, giá vẫn có tuần giảm mạnh nhất 2 tháng do kỳ vọng Cục Dự trữ liên bang Mỹ (FED) tăng lãi suất lần đầu tiên trong gần một thập kỷ.</span></p>\n<p class="Normal">\n	Kim loại quý từng đạt đỉnh 5 tháng trong tháng này. Nhưng những lo ngại về đà tăng quá mạnh đã thúc đẩy nhà đầu tư bán chốt lời vài phiên gần đây, khiến thị trường lao dốc. Giá chỉ phục hồi phần nào nhờ thông tin Mỹ tăng trưởng 2,6% quý cuối năm ngoái, nhưng triển vọng vẫn không quá sáng sủa.</p>\n<p class="Normal">\n	"GDP tăng chậm, nhưng các yếu tố nền tảng khác vẫn mạnh. Vì vậy, chúng tôi không lạc quan lắm vào vàng", Ed Meir - nhà phân tích tại INTL FCStone cho biết. Giá các hợp đồng giao tháng 2 cũng tăng nhẹ gần 5 USD, lên 1.260 USD một ounce.</p>\n<p class="Normal">\n	Nhu cầu vật chất tại châu Á hôm qua cũng ảm đạm, bất chấp giá gần đây ở mức thấp. Tháng này, thị trường đã lên 6,5% do bất ổn từ châu Âu, sau khi Ngân hàng trung ương Thụy Sĩ bỏ neo tỷ giá và ECB tung kích thích.</p>\n<p class="Normal">\n	"Chúng tôi đã vài lần chứng kiến vàng phục hồi như thế này vài lần rồi, năm ngoái cũng tương tự thế khi khủng hoảng Ukraine nổ ra. Rồi giá lại đi xuống thôi", Carsten Menke - nhà phân tích tại Julius Baer nhận định.</p>\n<p class="Normal">\n	UBS thì cho rằng sự giảm giá gần đây là do nhà đầu tư muốn chốt sổ và kiếm lời trước ngày cuối tháng. "Số hợp đồng bán ròng vàng đã tăng 58% từ đầu năm nay", hãng cho biết.</p>\n<p class="Normal">\n	Trên thị trường dầu thô, WTI vẫn đứng tại 48,24 USD một thùng. Trong khi đó, dầu Brent lại tăng mạnh lên gần 53 USD sau báo cáo cho thấy số giàn khoan dầu của Mỹ giảm kỷ lục trong tuần.</p>\n<p class="Normal" style="text-align:right;">\n	<strong>Hà Thu</strong></p>                                    ', NULL, 'filtered_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 22, 22, 'und', 0, '\n                                        <p class="Normal">\n	Theo tin từ Cổng thông tin điện tử Chính phủ, trong phiên họp thường kỳ ngày 30/1, Thủ tướng cho rằng trong điều kiện giá dầu xuống thấp, việc dự trữ có thể đảm bảo an ninh năng lượng, đồng thời tạo nguồn bán ra khi thị trường phục hồi. </p>\n<p class="Normal">\n	<span>Do vậy, người đừng đầu Chính phủ đồng ý với đề xuất của Bộ Công Thương về việc dự trữ 1-1,5 triệu tấn dầu. Theo thông tin từ Tập đoàn Dầu khí, lượng dự trữ này có thể đến từ cả nguồn nhập khẩu và </span><span> khai thác trong nước.</span></p>\n<p class="Normal">\n	Quan điểm mua dầu về dự trữ khi giá xuống thấp từng được Chủ tịch UBND TP HCM - Lê Hoàng Quân đưa ra cách đây một tháng, tại phiên họp Chính phủ trực tuyến với các địa phương. <span>Dù vậy, trao đổi với báo chí ngay sau đó, Chủ tịch Tập đoàn Dầu khí - Nguyễn Xuân Sơn cho rằng việc xác định giá đáy để mua dự trữ là không đơn giản.</span></p>\n<p class="Normal">\n	Theo báo cáo của Bộ Kế hoạch & Đầu tư, trong tháng 1/2015, sản lượng khai thác dầu thô ước đạt 1,47 triệu tấn, tăng 1,1% so với tháng 12/2014 và tăng 10,6% so với cùng kỳ năm 2014. Tuy nhiên, thu ngân sách từ dầu chỉ bằng 87,5% cùng kỳ.</p>\n<p class="Normal">\n	Việc giá dầu giảm dưới 50 USD một thùng và chưa có dấu hiệu hồi phục sẽ ảnh hưởng đến kế hoạch khai thác các mỏ dầu, đặc biệt là các mỏ có giá thành cao hơn hoặc bằng giá bán.</p>\n<p class="Normal">\n	Tập đoàn Dầu khí Quốc gia Việt Nam cho biết đang rà soát việc khai thác và giá thành từng mỏ, từ đó xây dựng các phương án khai thác theo các kịch bản của giá dầu thế giới, đảm bảo không lỗ. Theo kịch bản về chiều hướng giá dầu giảm như hiện tại, sản lượng khai thác cũng có thể giảm 1,2 triệu tấn.</p>\n<p class="Normal">\n	Trong khi đó, tại hội nghị liên bộ về điều hành kinh tế vĩ mô cuối tuần trước, Thủ tướng cũng yêu cầu các bộ xây dựng phương  <span>án điều hành ngân sách nhà nước theo kịch bản giá dầu thấp nhất do Tổ công tác liên bộ đưa ra, ở mức 40 USD mỗi thùng.</span></p>\n<p class="Normal" style="text-align:right;">\n	<strong>Kỳ Duyên</strong></p>                                    ', NULL, 'filtered_html'),
('node', 'article', 0, 23, 23, 'und', 0, '\n                        \n				<img alt="datdai-4107-1420009236-7255-1422755182.j" data-natural- src="http://m.f29.img.vnecdn.net/2015/02/01/datdai-4107-1420009236-7255-1422755182.jpg">\n		\n				<p class="Image">\n					Từ 15/2, đối với cơ quan hành chính, đơn vị sự nghiệp, công ty nhà nước, số tiền thu được từ bán tài sản trên đất; chuyển nhượng quyền sử dụng đất phải được nộp vào tài khoản tạm giữ tại kho bạc nhà nước do Bộ Tài chính làm chủ tài khoản.</p>\n			\n		<p>\n	<strong style="color:rgb(0,0,0);">30 công nghệ từ nước ngoài bị cấm chuyển giao vào Việt Nam</strong></p>\n<p class="Normal">\n	Theo Nghị định số 120 của Chính phủ sửa đổi, bổ sung, quy định chi tiết và hướng dẫn thi hành một số điều của Luật Chuyển giao công nghệ, có 30 công nghệ bị cấm chuyển giao từ nước ngoài vào Việt Nam và trong lãnh thổ Việt Nam. Trong đó có công nghệ vô hiệu hóa thiết bị đo, đếm, tính lượng điện năng sử dụng; sản xuất xi măng lò đứng; sản xuất thuốc bảo quản lâm sản chứa Pentachlorophenol (PCP)... Quy định này có hiệu lực từ hôm nay.</p>\n<p class="Normal">\n	3<strong>6 phế liệu được phép nhập khẩu làm nguyên liệu sản xuất</strong></p>\n<p class="Normal">\n	<span>Từ ngày 5/2, theo quy định của Chính phủ, có 36 phế liệu mới được phép nhập khẩu từ nước ngoài làm nguyên liệu sản xuất như thạch cao; xỉ hạt nhỏ (xỉ cát) từ công nghiệp luyện sắt hoặc thép; đồng, nhôm phế liệu và mảnh vụn...</span></p>\n<p class="Normal">\n	<strong>Quy định mới về chế độ tài sản của vợ chồng</strong></p>\n<p class="Normal">\n	Theo Nghị định 126 của Chính phủ có hiệu lực từ 15/2, quy định chi tiết một số điều và biện pháp thi hành Luật Hôn nhân và gia đình thì tài sản riêng khác của vợ, chồng theo quy định của pháp luật sẽ gồm: Tài sản vợ, chồng xác lập quyền sở hữu riêng theo bản án, quyết định của tòa án hoặc cơ quan có thẩm quyền khác; Khoản trợ cấp, ưu đãi mà vợ, chồng được nhận theo quy định của pháp luật về ưu đãi người có công với cách mạng...</p>\n<p class="Normal">\n	Ngoài ra, thu nhập hợp pháp khác của vợ, chồng trong thời kỳ hôn nhân sẽ gồm: Khoản tiền thưởng, tiền trúng thưởng xổ số, tiền trợ cấp; Tài sản mà vợ, chồng được xác lập quyền sở hữu theo quy định của Bộ luật Dân sự đối với vật vô chủ, vật bị chôn giấu, bị chìm đắm, vật bị đánh rơi, bị bỏ quên, gia súc, gia cầm bị thất lạc, vật nuôi dưới nước...</p>\n<p class="Normal">\n	<strong>Quy định mới về quản lý tiền thu được từ sắp xếp lại nhà, đất</strong></p>\n<p class="Normal">\n	Cũng từ ngày 15/2, việc quản lý, sử dụng tiền thu được từ bán tài sản trên đất, chuyển nhượng quyền sử dụng đất, chuyển mục đích sử dụng đất thuộc sở hữu nhà nước sẽ được thực hiện theo quyết định 71 của Thủ tướng.</p>\n<p class="Normal">\n	Theo đó, đối với cơ quan hành chính, đơn vị sự nghiệp, công ty nhà nước, số tiền thu được từ bán tài sản trên đất, chuyển nhượng quyền sử dụng đất phải được nộp vào tài khoản tạm giữ tại kho bạc nhà nước do Bộ Tài chính làm chủ tài khoản.</p>\n<p class="Normal">\n	<span>Tài khoản tạm giữ tại kho bạc nhà nước cấp tỉnh do Sở Tài chính làm chủ tài khoản (đối với cơ quan hành chính, đơn vị sự nghiệp, công ty nhà nước thuộc địa phương quản lý) trong thời hạn 90 ngày, kể từ ngày cơ quan nhà nước có thẩm quyền phê duyệt kết quả trúng đấu giá (đối với trường hợp bán đấu giá)...</span></p>\n<p class="Normal">\n	Trường hợp quá thời hạn này mà chưa nộp đủ số tiền vào tài khoản tạm giữ thì bị phạt theo quy định của pháp luật về quản lý thuế...</p>\n<p class="Normal">\n	<strong>Dạy và học bằng tiếng nước ngoài trong nhà trường</strong></p>\n<p class="Normal">\n	Từ ngày 20/2, việc dạy và học bằng tiếng nước ngoài trong các cơ sở giáo dục phổ thông, giáo dục thường xuyên, giáo dục nghề nghiệp và cơ sở giáo dục đại học; chương trình giáo dục phổ thông có thể được dạy và học một phần hoặc hoàn toàn bằng tiếng nước ngoài, ưu tiên đối với các lĩnh vực Toán, Khoa học tự nhiên, Công nghệ và Tin học. </p>\n<p class="Normal">\n	<strong>Xử lý kịp thời cán bộ sách nhiễu dân</strong></p>\n<p class="Normal">\n	Theo Nghị định có hiệu lực từ ngày 25/2 về thực hiện dân chủ trong hoạt động của cơ quan hành chính nhà nước và đơn vị sự nghiệp công lập, người đứng đầu cơ quan, đơn vị phải kịp thời có những biện pháp xử lý thích hợp theo quy định của pháp luật đối với những cán bộ, công chức, viên chức không hoàn thành nhiệm vụ, thiếu tinh thần trách nhiệm, sách nhiễu, gây phiền hà, tham nhũng trong việc giải quyết công việc của công dân, tổ chức....</p>\n<p class="Normal">\n	Ngoài những quy định trên, cũng trong tháng 2, nhiều quy định mới về bảo đảm an toàn trong hoạt động của tổ chức tín dụng, sắp xếp, đổi mới các công ty nông - lâm nghiệp hay tiêu chuẩn xét tặng "Nghệ nhân nhân dân", Nghệ nhân ưu tú" nghề thủ công mỹ nghệ cũng có hiệu lực.</p>\n<p class="Normal" style="text-align:right;">\n	<strong>Phương Sơn</strong></p>                                                ', NULL, 'filtered_html');
