INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(3, 'node', ' chùm ảnh du khách thích thú chụp ảnh cùng tuyết trắng ở sa pa tối đêm ngày 91 nhiệt độ ngoài trời đã hạ xuống thấp nhất từ đầu mùa đông tới nay vì vậy tại khu vực trạm tôn hay ô quý hồ ở sa pa tuyết đã rơi trắng xóa cả vùng rộng lớn chỉ sau 1 đêm nhiều nhà cửa cây cối đã chìm trong lớp tuyết trắng những hình ảnh tuyết rơi trắng xóa tại khu vực gần thác bạc những bông tuyết đậu trắng phủ kín hàng rào ánh lên trong đêm và cây cối 2 bên đường đầy tuyết trắng nhiệt độ ngoài trời tại khu vực gần thác bạc đã hạ xuống dưới  độ c vào đêm ngày 91 biết tin khu vực sa pa có thể sẽ có tuyết rơi vào đêm 91 sáng 101 rất đông du khách đã nhanh chóng lên đường tới thăm sa pa để được ngắm tuyết rơi hiện tượng thiên nhiên hiếm gặp tại việt nam tuyết trắng phủ kín bên tuyến đường dẫn lên sa panhững căn nhà phủ đầy tuyết trắngnhiều du khách hà nội đã lên đường lên sa pa ngay từ đêm qua cùng nhóm bạn để có thể tận mắt chứng kiến cảnh tuyết rơi và ghi lại những hình ảnh đáng nhớ nhiều du khách đã kịp lên sa pa ngay trong đêmcác thành viên trong gia đình thích thú tạo dáng với tuyếtai cũng muốn lưu giữ những khoảnh khắc đẹp và hiếm cócả vùng núi rộng lớn đều có thể thấy tuyết phủ trắng xoá tạo nên khung cảnh đẹp mắtcận cảnh từng bông tuyết nhỏ phủ kín một vùng núi rừng theo trung tâm dự báo khí tượng thuỷ văn trung ương khoảng 22h đêm qua tuyết bắt đầu rơi dày tại khu vực trạm tôn thác bạc ở sa pahôm nay nhiệt độ bắc bộ tiếp tục giảm mạnh cả vùng chìm trong rét đậm rét hại do trời lạnh đường trơn có mưa lớn những người thích đi du lịch mong chờ ngắm tuyết cần cẩn trọng khi di chuyển tránh để xảy ra tai nạn đáng tiếcở hà nội hôm nay 101 nhiệt độ chỉ còn 10 đến 14 độ c đây là dịp cuối tuần có thời tiết khắc nghiệt nhất kể từ đầu mùa đông đến giờ ảnh doãn tuấn  danh mục 1 ', 0),
(4, 'node', ' usd ngân hàng giảm ngày thứ ba liên tiếp vàng tăng nhẹ vnexpress kinh doanh thứ bảy 1012015 937 gmt 7 danh mục 1 ', 0),
(5, 'node', ' usd ngân hàng giảm ngày thứ ba liên tiếp vàng tăng nhẹ vnexpress kinh doanh danh mục 1 ', 0),
(6, 'node', ' usd ngân hàng giảm ngày thứ ba liên tiếp vàng tăng nhẹ vnexpress kinh doanh danh mục 1 ', 0),
(7, 'node', ' yoon eun hye phát phì đáng sợ trong phim mới trong phim điện ảnh vừa ra mắt chronicle of the blood merchant bất cứ khán giả nào cũng giật mình với tạo hình kém hấp dẫn của diễn viên xinh đẹp yoon eun hye yoon eun hye với vẻ đẹp nguyên mẫu vào vai im boon bang một cô gái trẻ có mối nhân duyên đặc biệt với heo sam gwan ha jung woo sau khi kết hôn boon bang trở thành người phụ nữ béo ú tận 100kg theo trang naver yoon eun hye đã phải cần đến sự hỗ trợ của chuyên gia hóa trang cô nàng chấp nhận hy sinh dung mạo bắt mắt ngày thường của mình để biến đổi thành một cô gái kém xinh được biết thêm trong phim điện ảnh lần này cô vào vai một nhân vật có vẻ gần gũi và hiền thục yoon eun hye trong vai boon bang béo ú gây sốcha jung woo nam chính kiêm đạo diễn phimcòn ha jung woo nam chính đồng thời là đạo diễn phim đã xúc động chia sẻ rằng khi tôi mời yoon eun hye vào vai nhân vật người phụ nữ béo tròn im boon bang người có ngoại hình hoàn toàn đối lập với bản thân cô ấy đã vui vẻ nhận lời mặc dù chỉ là một vai diễn nhỏ nhưng tôi thật đánh giá cao lòng dũng cảm trước thử thách và khả năng ứng biến linh hoạt của nữ diễn viên yoon eun hye dù chỉ tham gia với một vai phụ nhưng cô gái này vẫn làm việc với tinh thần vì nghệ thuật rất chuyên nghiệpphim có nội dung nói về câu chuyện thú vị của chàng heo sam gwan một người đàn ông của gia đình bỗng nhiên nhận ra mình đã chăm sóc con của người đàn ông khác suốt 11 năm trời đây là một phim hài về đề tài gia đình một chủ đề được điện ảnh hàn khai thác khá tốtphim còn có sự tham gia diễn xuất của khá nhiều gương mặt diễn viên đáng chú ý ha jung woo ha ji won sung dong il joo jin mo kim sung ryung và nhiều diễn viên khácchronicle of the blood merchant được công chiếu vào ngày 14 tháng 1 nguồn naver  danh mục 2 ', 0),
