(9, 'node', ' hàng tết vào nam loay hoay gỡ khó vnexpress kinh doanh thứ bảy 3112015 1711 gmt 7 thứ bảy 3112015 1711 gmt 7 hàng tết vào nam loay hoay gỡ khó thay vì nhập cả chục tấn hàng một lúc để tránh lỗ các chủ cửa hàng thực phẩm miền bắc năm nay chỉ lấy theo đơn đặt hàng và ưu tiên các sản phẩm mang lại lợi nhuận cao chỉ còn 2 tuần nữa là tới tết nguyên đán nhưng không khí mua bán ở nhiều cửa hàng chuyên kinh doanh thực phẩm miền bắc tại tp hcm vẫn khá ảm đạm chị hoa chủ cửa hàng thực phẩm hà nội tại chợ văn thánh bình thạnh cho biết thời điểm này năm ngoái đã có nhiều khách ghé thì năm nay khá èo uột đặc biệt một số mặt hàng thực phẩm tươi sống khách hàng không còn ưa chuộng do đó nếu lấy hàng dự trữ như mọi năm sẽ rất dễ bị lỗ thay vì ưu tiên vận chuyển mặt hàng tươi sống năm nay tôi chỉ lấy bằng một nửa năm ngoái và chỉ nhập theo đơn đặt hàng của khách đồng thời tăng cường lấy các mặt hàng chủ lực có thể giữ được trong thời gian dài như gạo nếp miến măng khô đậu xanh chị hoa nói cam canh được nhiều chủ cửa hàng đồ bắc tại tp hcm bán dịp tết năm nay ảnh hồng châu chị cũng cho biết dịp lễ tết thì trái cây những mặt hàng tâm linh dễ kiếm lời hơn so với những mặt hàng khác lại được khách ưa chuộng do vậy mặt hàng này được chị chú trọng mặt khác để đảm bảo có lãi ổn định thì chỉ nên chọn các mặt hàng trái cây truyền thống và lạ để được trong thời gian dài như cam canh bưởi diễn phật thủ thông thường các loại trái cây này giữ được trong 23 tháng ngoài ra để tiết kiệm chi phí vận chuyển đối với một số nhóm hàng khô chị chọn cách nhập thông qua đường sắt và bộ giá cước rẻ hơn 3040 so với vận chuyển bằng đường hàng không chỉ có một số loại giò chả tết bánh chưng là đặt gửi qua máy bay cũng nhận thấy thị trường không mấy nhộn nhịp ông khánh chủ cửa hàng thực phẩm hà nội trên đường trần quốc toản quận 3 chia sẻ năm nay ông quyết định vận chuyển hàng theo ngày bán đến đâu nhập hàng đến đó chứ không vận chuyển cùng một lúc vài tấn như mọi năm nữa bởi lẽ nếu trữ hàng nhiề