(12, 'node', ' độc chiêu thổi hồn cho quất kiểng kiếm tiền triệu kinh doanh thứ bẩy 31012015 1202 bến tre độc chiêu thổi hồn cho quất kiểng kiếm tiền triệu alt thích style margintop 5px  dân trí những ngày này ở vương quốc hoa kiểng chợ lách bến tre các nghệ nhân đang tất bật thổi hồn vào những cây quất tắc pv kiểng tạo thành hình con vật tháp hoa sen rất độc đáo nhờ nghề hóa phép này nhiều nghệ nhân kiếm tiền triệu xài tết vùng đất chợ lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa cây kiểng cung ứng cho thị trường trong cả nước trong đó nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được đặc biệt nhất là sản phẩm quất kiểng hình bon sai thú hoa sen ông nhựt đang uốn quất kiểng thành hình tháp những ngày cận tết ông nguyễn minh nhựt ngụ ấp tây lộc vĩnh thành chợ lách bến tre đang tất bật vô chậu uốn những cây quất kiểng thành hình tháp ông nhựt cho biết tôi làm nghề sản xuất cây giống nhưng năm nào đến tết cũng làm thêm quất kiểng bỏ mối cho thương lái để làm được cây quất bán tết phải chuẩn bị suốt 1 năm từ trồng cây con chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng theo ông nhựt thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán tết nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ long xuyên an giang tiếp tục bán lẻ trung bình mỗi mùa tết gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng nghệ nhân đang biến quất thành hình dê phục vụ tết ất mùi sản phẩm độc chiêu các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật trong đó con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm năm ất mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng cặp tùy theo kích cỡ vườn quất kiểng hình dê rồng búp sen của ông tòng ông lê văn bá tòng ngụ ấp hòa lộc vĩnh hòa chợ lách chuyên uốn 