trong dịp tết quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng chậu ông bùi thanh liêm trưởng phòng nn ptnt huyện chợ lách cho biết tết nguyên đán ất mùi năm nay nhà vườn huyện chợ lách sẽ sản xuất khoảng 34 triệu sản phẩm hoa kiểng trong đó chủ lực là mai vàng quất tắc kiểng vạn thọ cúc mâm xôi cúc đài loan sản phẩm từ làng hoa kiểng chợ lách được bán hầu khắp các tỉnh miền đông tp hồ chí minh và đồng bằng sông cửu long bằng bàn tay tài hoa của mình những nghệ nhân nơi đây đã thổi hồn vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp tết minh giang      danh mục 1 ', 0),
