ẩm từ làng hoa kiểng chợ lách được bán hầu khắp các tỉnh miền đông tp hồ chí minh và đồng bằng sông cửu long bằng bàn tay tài hoa của mình những nghệ nhân nơi đây đã thổi hồn vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp tết minh giang    danh mục 1 ', 0),
