(18, 'node', ' độc chiêu thổi hồn cho quất kiểng kiếm tiền triệu vùng đất chợ lách từ lâu đời đã nổi tiếng với nghề sản xuất hoa cây kiểng cung ứng cho thị trường trong cả nước trong đó nghề trồng quất kiểng được các nghệ nhân ở đây tạo ra nhiều hình dáng rất độc đáo khó nơi nào có được đặc biệt nhất là sản phẩm quất kiểng hình bon sai thú hoa sen ông nhựt đang uốn quất kiểng thành hình tháp những ngày cận tết ông nguyễn minh nhựt ngụ ấp tây lộc vĩnh thành chợ lách bến tre đang tất bật vô chậu uốn những cây quất kiểng thành hình tháp ông nhựt cho biết tôi làm nghề sản xuất cây giống nhưng năm nào đến tết cũng làm thêm quất kiểng bỏ mối cho thương lái để làm được cây quất bán tết phải chuẩn bị suốt 1 năm từ trồng cây con chăm sóc đợi đến những tháng cuối năm sẽ xử lý cho ra trái rồi uốn thành những hình theo ý muốn mỗi giỏ quất kiểng chỉ có giá từ 300 đến 400 ngàn đồng theo ông nhựt thường thì đến 20 tháng chạp thương lái sẽ đến lấy hàng chở đến các chợ bán tết nếu bán cho thương lái không hết gia đình ông sẽ thuê xe chuyển qua chợ long xuyên an giang tiếp tục bán lẻ trung bình mỗi mùa tết gia đình ông kiếm thêm khoảng 20 triệu đồng từ nghề tạo hình cho quất kiểng nghệ nhân đang biến quất thành hình dê phục vụ tết ất mùi sản phẩm độc chiêu các nghệ nhân nơi đây là những cây quất kiểng thành hình con vật trong đó con vật được ưa thích nhất tương ứng theo con giáp của mỗi năm năm ất mùi này nhiều nghệ nhân ở chợ lách làm ra hình con dê rất độc đáo với giá bán từ 3 đến 4 triệu đồng cặp tùy theo kích cỡ vườn quất kiểng hình dê rồng búp sen của ông tòng ông lê văn bá tòng ngụ ấp hòa lộc vĩnh hòa chợ lách chuyên uốn quất kiểng thành hình con dê rồng cho biết năm nào tôi cũng làm quất kiểng hình con rồng và con giáp tương ứng để chuyển lên các thành phố lớn bán tùy theo kích cỡ sẽ tốn nguyên liệu là cây quất nhiều hay ít mà giá bán cao hay thấp theo ông tòng để có hình như ý muốn một nghệ nhân sẽ tốn vài ngày để cắt sắt làm khung rồi uốn để trái lòi ra bên ngoài giống hình con vật búp sen hay hình tháp do quả quất khi chín màu vàng nên hình rất đẹp quất kiểng hình cá chép ngoài việc tạo dáng quất thành hình con dê ông tòng còn làm hình con rồng hình búp sen bán trong dịp tết với giá khoảng 4 triệu đồng cặp ông tòng cho biết tạo dáng quất thành hình con vật hình tháp đã xuất hiện ở chợ lách khoảng chục năm nay nhưng đây là năm đầu tiên tôi làm hình búp sen để làm ra cái búp sen cao hơn 1 m tôi phải tốn 20 chậu quất các loại ghép vào sau đó tạo dáng rồi cho vào chậu sành với hình búp sen chuẩn bị nở rất độc hy vọng năm nay sẽ đắt hàng quất kiểng hình rồng ở làng hoa kiểng chợ lách mấy năm nay lại rộ lên phòng trào trồng kiểng cổ thụ tạo dáng bon sai rồi cho vô chậu bán trong dịp tết những cây quất này có dáng đẹp không thua gì mai hay các lại cây khác nhưng đặc biệt là có trái màu vàng rất đẹp tết năm nay ông nguyễn văn thi ngụ ấp hòa khánh vĩnh thành chợ lách sẽ tung ra thị trường hơn 1000 chậu quất cổ thụ với giá từ 1 đến 3 triệu đồng chậu ông thi đang tất bật hoàn tất các công đoạn cuối cùng để đưa quất kiểng của mình lên thành phố những ngày cận tết ông tòng đang hóa phép quất thành hình búp sen quất kiểng hình tháp bình hoa là sản phẩm độc đáo của làng hoa chợ lách ông thi chia sẻ những chậu quất kiểng của tôi đều được tạo dáng rồi cho vô chậu xử lý cho ra quả đúng vào dịp tết quất kiểng giá tương đối mềm nhưng dáng rất đẹp nên được thị trường ưa chuộng theo nhiều nhà vườn nơi đây quất là cây có múi nên từ 10 năm trở lên đã là cây cổ thụ và có thể cắt ngắn tạo dáng rồi cho vô chậu bán tết hiện tại nhà vườn chợ lách đang sưu tầm rất nhiều cây quất trên 10 năm tuổi dáng bon sai rất đẹp để tung ra thị trường trong dịp tết quất kiểng cổ thụ được cho vào chậu có giá từ 1 đến 3 triệu đồng chậu ông bùi thanh liêm trưởng phòng nn ptnt huyện chợ lách cho biết tết nguyên đán ất mùi năm nay nhà vườn huyện chợ lách sẽ sản xuất khoảng 34 triệu sản phẩm hoa kiểng trong đó chủ lực là mai vàng quất tắc kiểng vạn thọ cúc mâm xôi cúc đài loan sản phẩm từ làng hoa kiểng chợ lách được bán hầu khắp các tỉnh miền đông tp hồ chí minh và đồng bằng sông cửu long bằng bàn tay tài hoa của mình những nghệ nhân nơi đây đã thổi hồn vào thành những cây quất để biến thành hình thù độc đáo kiếm tiền triệu trong dịp tết minh giang    danh mục 1 ', 0),
