(20, 'node', ' vui buồn thưởng tết số liệu từ bộ lao động thương binh và xã hội cho biết tới giữa tháng 12015 phần lớn các doanh nghiệp đơn vị trên cả nước đã có kế hoạch thưởng tết cho nhân viên với mức bình quân là 5 triệu đồng người trước đó đã có hơn 80 doanh nghiệp thưởng tết dương lịch cho nhân viên với khoảng 15 triệu đồng người  khó có bức tranh chính xác đọc những thông tin kinh tế tài chính mới nhất trên  fica     người tiêu dùng e ngại táo nhập khẩu liêu xiêu   bơm thêm 50000 tỉ đồng cho bất động sản   những làng đồng nát bạc tỉ bới vàng trong rác    hàng trăm hãng taxi đồng loạt giảm cước   thế giới di động lên mục tiêu vượt 1 tỷ usd doanh thu năm 2015 thống kê mới nhất cho thấy kỷ lục thưởng tết năm nay thuộc về doanh nghiệp tại tphcm với mức thưởng tết dương lịch là 583 triệu đồng và doanh nghiệp fdi tại bình dương với mức thưởng tết nguyên đán ất mùi là 482 triệu đồngtrong khi đó mức thưởng tết cao nhất tại hà nội chỉ là 856 triệu đồng so với năm ngoái là 709 triệu đồng mức thưởng cao nhất còn thua khá xa nếu chia bình quân thì theo bộ lao động thương binh và xã hội mức thưởng năm nay khoảng 5 triệu đồng người tương đương 1 tháng lương của người lao độngtuy nhiên con số 13000 doanh nghiệp được khảo sát chỉ chiếm khoảng 3 tổng số doanh nghiệp trên cả nước nên khó lòng coi con số 5 triệu đồng tiền thưởng bình quân nói trên là mức đại diện mà tất cả người lao động được hưởng một thực tế tồn tại từ nhiều năm đó là chỉ những doanh nghiệp có mức thưởng tết tạm ổn thì mới báo cáo lên cơ quan quản lý nhà nước do vậy sẽ rất khó có một bức tranh chính xác về tình hình thưởng tết ở tất cả mọi doanh nghiệp cơ quan đơn vị bên cạnh những doanh nghiệp có mức thưởng cao ngất ngưởng còn nhiều doanh nghiệp chỉ thưởng cho người lao động những khoản tiền hết sức tượng trưngví dụ một doanh nghiệp tư nhân ở phía nam thưởng tết với mức 30000 đồng người được cho là mức thấp nhất qua khảo sát tại một số địa phương vẫn còn không ít doanh nghiệp đơn vị chỉ thưởng bằng hiện vật 