(21, 'node', ' giá vàng tăng mạnh phiên cuối tuần vnexpress kinh doanh giá này tương đương 3304 triệu đồng một lượng chưa thuế phí thị trường trong nước hôm qua đóng cửa quanh 35243534 triệu đồng dù vậy giá vẫn có tuần giảm mạnh nhất 2 tháng do kỳ vọng cục dự trữ liên bang mỹ fed tăng lãi suất lần đầu tiên trong gần một thập kỷ kim loại quý từng đạt đỉnh 5 tháng trong tháng này nhưng những lo ngại về đà tăng quá mạnh đã thúc đẩy nhà đầu tư bán chốt lời vài phiên gần đây khiến thị trường lao dốc giá chỉ phục hồi phần nào nhờ thông tin mỹ tăng trưởng 26 quý cuối năm ngoái nhưng triển vọng vẫn không quá sáng sủa gdp tăng chậm nhưng các yếu tố nền tảng khác vẫn mạnh vì vậy chúng tôi không lạc quan lắm vào vàng ed meir nhà phân tích tại intl fcstone cho biết giá các hợp đồng giao tháng 2 cũng tăng nhẹ gần 5 usd lên 1260 usd một ounce nhu cầu vật chất tại châu á hôm qua cũng ảm đạm bất chấp giá gần đây ở mức thấp tháng này thị trường đã lên 65 do bất ổn từ châu âu sau khi ngân hàng trung ương thụy sĩ bỏ neo tỷ giá và ecb tung kích thích chúng tôi đã vài lần chứng kiến vàng phục hồi như thế này vài lần rồi năm ngoái cũng tương tự thế khi khủng hoảng ukraine nổ ra rồi giá lại đi xuống thôi carsten menke nhà phân tích tại julius baer nhận định ubs thì cho rằng sự giảm giá gần đây là do nhà đầu tư muốn chốt sổ và kiếm lời trước ngày cuối tháng số hợp đồng bán ròng vàng đã tăng 58 từ đầu năm nay hãng cho biết trên thị trường dầu thô wti vẫn đứng tại 4824 usd một thùng trong khi đó dầu brent lại tăng mạnh lên gần 53 usd sau báo cáo cho thấy số giàn khoan dầu của mỹ giảm kỷ lục trong tuần hà thu danh mục 1 ', 0),
(22, 'node', ' thủ tướng đồng ý dự trữ 115 triệu tấn dầu vnexpress kinh doanh theo tin từ cổng thông tin điện tử chính phủ trong phiên họp thường kỳ ngày 301 thủ tướng cho rằng trong điều kiện giá dầu xuống thấp việc dự trữ có thể đảm bảo an ninh năng lượng đồng thời tạo nguồn bán ra khi thị trường phục hồi do vậy người đừng đầu chính phủ đồng ý với đề xuất của bộ công thương về việc dự trữ 115 triệu tấn dầu theo thông tin từ tập đoàn dầu khí lượng dự trữ này có thể đến từ cả nguồn nhập khẩu và khai thác trong nước quan điểm mua dầu về dự trữ khi giá xuống thấp từng được chủ tịch ubnd tp hcm lê hoàng quân đưa ra cách đây một tháng tại phiên họp chính phủ trực tuyến với các địa phương dù vậy trao đổi với báo chí ngay sau đó chủ tịch tập đoàn dầu khí nguyễn xuân sơn cho rằng việc xác định giá đáy để mua dự trữ là không đơn giản theo báo cáo của bộ kế hoạch đầu tư trong tháng 12015 sản lượng khai thác dầu thô ước đạt 147 triệu tấn tăng 11 so với tháng 122014 và tăng 106 so với cùng kỳ năm 2014 tuy nhiên thu ngân sách từ dầu chỉ bằng 875 cùng kỳ việc giá dầu giảm dưới 50 usd một thùng và chưa có dấu hiệu hồi phục sẽ ảnh hưởng đến kế hoạch khai thác các mỏ dầu đặc biệt là các mỏ có giá thành cao hơn hoặc bằng giá bán tập đoàn dầu khí quốc gia việt nam cho biết đang rà soát việc khai thác và giá thành từng mỏ từ đó xây dựng các phương án khai thác theo các kịch bản của giá dầu thế giới đảm bảo không lỗ theo kịch bản về chiều hướng giá dầu giảm như hiện tại sản lượng khai thác cũng có thể giảm 12 triệu tấn trong khi đó tại hội nghị liên bộ về điều hành kinh tế vĩ mô cuối tuần trước thủ tướng cũng yêu cầu các bộ xây dựng phương án điều hành ngân sách nhà nước theo kịch bản giá dầu thấp nhất do tổ công tác liên bộ đưa ra ở mức 40 usd mỗi thùng kỳ duyên danh mục 1 ', 0);
